INSERT INTO `db_mdd_news` (`id`, `meta_title`, `meta_robots`, `meta_keywords`, `meta_description`, `meta`, `system`, `date`, `img`, `preview`, `desc`, `title`, `ord`, `visible`, `created`, `updated`, `uid`, `gid`) VALUES
(1, 'Обследование гнатолога в Краснодаре в стоматологии M-Denta', 'index,follow', '', 'Обследование гнатолога в Краснодаре в стоматологии M-Denta', 0, 'obsledovanie-gnatologa-v-klinike-m-denta', '30.09.2018', 'file_1_1153_5bd850e57c301', '<p>Напоминаем всем нашим настоящим и будущим пациентам, в клинике \"M-Denta\" работает высококвалифицированный врач гнатолог - Андреева Вера Николаевна.</p>\n<p>Детальная диагностика именно этого специалиста помогает максимально качественно и верно разработать план лечения при исправлении прикуса, имплантации зубов и других челюстных заболеваниях.</p>', '<p>Напоминаем всем нашим настоящим и будущим пациентам, в клинике \"M-Denta\" работает высококвалифицированный врач гнатолог - Андреева Вера Николаевна.&nbsp;</p>\n<p>Детальная диагностика именно этого специалиста помогает максимально качественно и верно разработать план лечения при исправлении прикуса, имплантации зубов и других челюстных заболеваниях.&nbsp;<br><br>Не всегда визит к гнатологу нужно откладывать до выраженных проблем с прикусом и челюстными суставами.&nbsp;</p>\n<h2><strong>7</strong><strong> симптомов, которые указывают на необходимость обратиться к гнатологу:</strong></h2>\n<p>• скрежет зубами</p>\n<p>• непрекращающиеся мышечные боли в лице, затылке, челюсти, шее</p>\n<p>• локализованные с одной стороны постоянные головные боли</p>\n<p>• дискомфорт при смыкании зубов</p>\n<p>• щелчки или хруст в области ушей или челюстных суставов</p>\n<p>• замирание челюсти в определённом положении при открывании и закрывании рта</p>\n<p>• постоянное закладывание и шум в ушах<br></p>', 'Обследование гнатолога в клинике M-Denta', 10, 1, 1540903306, 1540903306, 2, 0),
(2, 'Важная информация о зубных имплантах Nobel Biocare', 'index,follow', '', 'Зубные импланты Nobel Biocare уже давно зарекомендовали себя как одни из самых надежных и долговечных имплантов во всем мире.', 0, 'korotko-o-samom-vazhnom-v-nobel-biocare', '31.08.2018', 'file_1_1153_5bd85ceebd6f7', '<p>Имплантация зубов для многих пациентов решительный шаг, требующий длительного обдумывания, сравнения различных торговых марок имплантатов, прочтения огромного числа отзывов в интернет пространстве.</p>\n<p>Мы хотим сказать вам пять своих весомых \"За\" в пользу Nobel Biocare.</p>', '<p><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\">Имплантация зубов для многих пациентов решительный шаг, требующий длительного обдумывания, сравнения различных торговых марок имплантатов, прочтения огромного числа отзывов в интернет пространстве.</span></span><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><br></span></span></span></p>\n<h3><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Мы хотим сказать вам пять своих весомых \"За\" в пользу Nobel Biocare.</span></span></span></h3>\n<p><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">• Они разработаны самим основателем остеоинтеграции - профессором Пер-Ингваром Бранемарком.&nbsp;<br></span></span></span></p>\n<p><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">• Они имеют самую долгую в мире историю - успешно устанавливаются с 1965 г.&nbsp;<br></span></span></span></p>\n<p><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">• При их производстве применяют уникальные запатентованные технологии. Эффективность доказана 200 лабораторными и клиническими исследованиями.&nbsp;<br></span></span></span></p>\n<p><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">• На заводах, где изготавливают импланты, ведётся контроль качества 24 часа в сутки по специальной системе.<br></span></span></span></p>\n<p><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">• Их устанавливают 100 000 стоматологов по всему миру. 2 000 000 имплантатов устанавливаются ежегодно в 94 странах мира<br></span></span></span></p>\n<p><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></span></p>\n<h3><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">Желаем вам здоровья и счастливых улыбок!<br></span></span></span></h3>\n<h3><span style=\"font-size: 18px;\"><span style=\"font-size: 16px;\"><span style=\"color: rgb(0, 0, 0);\">И напоминаем - консультация в нашей клинике бесплатная.</span></span></span></h3>', 'Коротко о самом важном в Nobel Biocare', 20, 1, 1540906503, 1540906503, 2, 0),
(4, '4 мифа о имплантации зубов', 'index,follow', '', '', 0, '4-mifa-o-implantacii-zubov', '29.11.2018', 'file_1_1153_5bffe7dfc06da', '<p><strong>Миф первый:&nbsp;</strong>установка имплантатов длительный процесс, и весь этот период придется ходить и жить без зубов.<br><br>На сегодняшний день в стоматологии практикуется несколько способов имплантации зубов, в том числе и с немедленной нагрузкой . Но какой бы способ ни выбрали пациент и врач, исходя из бюджета и медицинских показаний, временные конструкции и коронки устанавливаются сразу после установки имплантата. Наша зуботехническая лаборатория изготовит максимально комфортные временные решения в самые короткие сроки, которые по эстетике не будут отличаться от последующих постоянных.&nbsp;</p>', '<br><p><strong><br></strong></p><p><strong>Миф первый:&nbsp;</strong>установка имплантатов - длительный процесс и весь этот период придется жить без зубов.<br><br>На сегодняшний день в стоматологии практикуется несколько способов имплантации зубов, в том числе и с немедленной нагрузкой . Но какой бы способ ни выбрали пациент и врач, исходя из бюджета и медицинских показаний, временные конструкции и коронки устанавливаются сразу после установки имплантата. Наша зуботехническая лаборатория изготовит максимально комфортные временные решения в самые короткие сроки, которые по эстетике не будут отличаться от последующих постоянных.&nbsp;<br><br><strong>Миф второй:</strong>&nbsp;при вживлении имплантата могут повредить кость.<br><br>В нашей клинике мы работаем только с современными хирургическими протоколами, широко известных и зарекомендовавших себя производителей: Nobel Bio care (Швеция)&nbsp; и MIS (Израиль).<br>Весь процесс лечения: от удаления больного зуба до вживления имплантата, определенно направлены на максимальное сохранение тканей и минимальный травматизм. Опыт и квалификация нашей команды это с уверенностью гарантирует.&nbsp;<br><br><strong>Миф третий:</strong>&nbsp;имплантаты – нельзя ставить в пожилом возрасте<br><br>Возраст пациента никогда не является противопоказанием, да и тотальное отсутствие зубов наблюдается именно у такой группы пациентов.<br>Абсолютным или временным противопоказанием&nbsp; к установке имплантатов могут быть только различного рода заболевания: онкология, плохая свертываемость крови, сахарный диабет и т.п. Окончательный вердикт о возможности операции может вынести только врач. С возрастными пациентами все ясно, а вот молодым не рекомендуется устанавливать имплантаты ранее 22 лет (так же данное решение принимает врач).&nbsp;<br><br><strong><br>Миф четвертый:</strong>&nbsp;имплантат может «не прижиться»&nbsp;<br><br>Зубной имплантат состоит из безопасных и технологичных сплавов, при установке он интегрируется и костные клетки врастают в поверхность имплантата - это называется остеоинтеграция.&nbsp;<br><br>Мы не исключаем осложнений после операции, основная масса их происходит в следствии человеческого фактора, например, несоблюдение пациентом рекомендаций стоматолога. Системы имплантации, которые практикуются в нашей клинике, уже подтвердили свою надежность и безопасность на протяжении нескольких десятков лет.&nbsp;<br><br><br>Самую достоверную информацию о возможностях лечения и периоде реабилитации может рассказать только врач. Записывайтесь на бесплатную консультацию в \"M-Denta\".<br></p>', '4 мифа о имплантации зубов', 30, 1, 1543498105, 1543498105, 2, 0);
