INSERT INTO `db_mdd_store` (`id`, `meta`, `meta_title`, `meta_keywords`, `meta_description`, `hit`, `size`, `system`, `seat_hight`, `price`, `manufacturer`, `country`, `filling`, `upholstery`, `description`, `residue`, `color`, `material`, `name`, `category`, `photo`, `ord`, `visible`, `created`, `updated`, `uid`, `gid`) VALUES
(1, 0, 'Кресло мешок эко-кожа', '', '', '', '15,16', 'kreslo-meshok', '', '0.00', 'Россия, Санкт-Петербург', 'Россия, Санкт-Петербург', 'гранулы пенополистерола.', '18', '<p>Удобное кресло-мешок подарит Вам новые ощущения комфорта, разнообразит отдых, раскрасит и оживит интерьер. Съемный чехол из заменителя кожи высокого качества достаточно протирать влажной тряпкой, чтобы он дарил приятный отдых долгие годы.</p>', 1, 'gold', '18', 'Кресло мешок', '19', 'file_31_526_53a0fa527a4d9', 10, '1', '2014-06-18 06:32:58', '2015-09-06 12:41:53', 2, ''),
(3, 0, 'Кресло мяч', '', '', '', '15', 'kreslo_myach', '', '0.00', 'Россия, Санкт-Петербург', 'Россия, Санкт-Петербург', 'гранулы пенополистерола.', '28', '<p>Кресло мяч черно-белое (диаметр 120 см),изготовлено из ткани Оксфорд (водонепроницаемая ткань).</p><p>Мягкое удобное кресло Мяч станет отличной игрушкой, забавой и развлечением для Вашего ребёнка.</p><p>Большой размер такого кресла  позволит присесть Вам вместе с малышом почитать книжку, посмотреть мультики.</p><p>Либо порадовать любителя футбола ;)</p>', 0, '0', '', 'Кресло мяч Оксфорд', '20', 'file_31_526_53e0a41e2da10', 30, '1', '2014-08-05 13:30:46', '2015-09-06 12:41:53', 2, ''),
(4, 0, '', '', '', '0', '15,16,17', 'kreslo-meshok-skay', '50 см.', '0.00', 'Россия, Санкт-Петербург', 'Россия, Санкт-Петербург', 'гранулы пенополистерола.', '29', '<p>Самое известное и продаваемое кресло-мешок во всём мире! Классическая модель бескаркасной мебели. Обладая удачной формой и оптимальным размером, кресло-груша можно использовать как в офисе, так и в квартире или загородном доме. Удачно подойдет для проведения вечеринок больших компаний, для детских комнат и гостиных. Кресло можно использовать и на улице, принимая солнечные ванны в наиболее удобной позе! Вытянутая спинка и широкое основание позволяют комфортно разместиться на этом кресле!. Чтобы купить кресло-груша достаточно оформить заказ или позвонить по телефонам указанным на нашем сайте. У нас \"вкусные\" цены!</p>', 3, 'blue', '', 'Кресло мешок Скай', '15', 'file_31_526_53e0a47274284', 40, '1', '2014-08-05 13:32:23', '2015-09-06 12:41:53', 2, ''),
(7, 0, 'кресло мешок грин краснодар', '', '', '', '15,16,17', 'kreslo_grusha_grin', '', '0.00', 'Россия, Краснодар', '', 'гранулы пенополистерола.', '30', '<p>Кресло-мешок Грин это классическая модель бескаркасной мебели.</p><p>Кресло имеет 2 чехла : внешний и внутренний.</p><p>Внешний чехол изготовлен из ткани оксфорд и имеет ручку для удобства переноски кресла.</p><p>Также кресло оснащено молниями что позволит снимать внешний чехол (для смены или стирки чехла) и досыпать наполнитель.</p>', 3, 'green', '', 'Кресло груша Грин', '15', 'file_31_526_53e6811f61a82', 70, '1', '2014-08-10 00:14:49', '2015-09-06 12:41:53', 2, ''),
(9, 0, '', '', '', '', '15,16,17', 'kreslo_grusha_vayn', '', '0.00', '', '', 'гранулы пенополистерола.', '32', '<p>Самое известное и продаваемое кресло-мешок во всём мире! Классическая модель бескаркасной мебели. Обладая удачной формой и оптимальным размером, кресло-груша можно использовать как в офисе, так и в квартире или загородном доме. Удачно подойдет для проведения вечеринок больших компаний, для детских комнат и гостиных. Кресло можно использовать и на улице, принимая солнечные ванны в наиболее удобной позе! Вытянутая спинка и широкое основание позволяют комфортно разместиться на этом кресле!. Чтобы купить кресло-груша достаточно оформить заказ или позвонить по телефонам указанным на нашем сайте. У нас \"вкусные\" цены!</p>', 1, 'red', '', 'Кресло-груша Вайн', '15', 'file_31_526_53e7c462799c6', 90, '1', '2014-08-10 23:15:34', '2015-09-06 12:41:53', 2, ''),
