(13, 0, '', '', '', '0', '15,16', 'kreslo-meshok-vaylet', '', '0.00', 'Россия, Санкт-Петербург', '', 'гранулы пенополистерола.', '0', '<p>Мягкое и уютное кресло мешок-груша! Внешний чехол из средне ворсового приятного на ощупь велюра! Велюр мебельный, высококачественный, износостойкий. Внешний чехол съемный на молнии, для удобства в уходе. Внутренний чехол из прочного спанбонда с застежкой-молнией. У кресла-мешка есть ручка для удобства переноски. В качестве наполнителя - гранулированный пенополистирол.</p><br>', 1, 'purple', '', 'Кресло мешок вайлет', '17', 'file_31_526_53e7cc440de92', 130, '1', '2014-08-10 23:48:56', '2015-09-06 12:41:53', 2, ''),
