(26, 0, '', '', '', '', '16', 'kreslo_grusha_plankton', '', '0.00', '', '', '', '30', '<p>Этот кресло мешок не оставит в равнодушных никого!!!!Самый прикольный персонаж любимого всеми мультика будет радовать только избранных!</p><p>Изготавливается на заказ в срок 3 дней.</p>', 0, 'green', '', 'Кресло груша Планктон', '24', 'file_31_526_54031864aa98d', 260, '1', '2014-08-31 16:45:03', '2015-09-06 12:41:53', 2, ''),
(27, 0, '', '', '', '', '16', 'kreslo_grusha_patrik', '', '0.00', '', '', '', '32', '<p>Кресло мешок Патрик порадует не только детей,которые обнажают этого персонажа,но так же и взрослых которые хотят разнообразить свой интерьер и окунуться в детство.)</p>', 0, '0', '', 'Кресло груша Патрик', '24', 'file_31_526_54031a9d1753f', 270, '1', '2014-08-31 16:56:58', '2015-09-06 12:41:53', 2, ''),
