(34, 0, '', '', '', '0', '16', 'kreslo_myach', '', '3290.00', '', '', '', '0', '<p>Кресло мешок мяч станет идеальным подарком поклоннику спорта, а так же станет незаменимой игрушкой для ребенка.</p><p>Ткань оксфорд отличается высокими показателями прочности, эластичности, водонепроницаемости, светостойкости, она легко выдерживает высокие и низкие температуры. Эту ткань можно сколько угодно сгибать и мять, и она выдержит все испытания, поэтому ее часто используют для пошива рюкзаков и палаток. Порвать ее очень сложно.</p>', 1, 'red', '', 'Кресло мяч Эко-кожа', '20', 'file_31_526_5475e490e1cdd', 340, '1', '2014-11-26 17:36:26', '2015-09-06 12:41:53', 2, ''),
