(51, 0, 'kreslo_grusha_piter', '', '', '', '15,16,17', 'kreslo_grusha_piter', '', '0.00', 'Россия, Санкт-Петербург', '', 'гранулы пенополистерола.', '0', '<p>Вы когда-нибудь были в Санкт-Петербурге?Или пока только мечтаете погулять по Невскому проспекту?Полюбоваться на ростральные колонны, взобраться на колоннаду Исаакиевского собора?Обязательно побывайте! Незабываемые впечатления! Особенно летними белыми ночами! А уютное кресло-груша \"Питер\" будет напоминать о приятно проведенном времени. Или же стимулировать Вас на посещение этого прекрасного города.</p>', 2, '0', '', 'Кресло Груша Питер', '17', 'file_31_526_5475e999764db', 510, '1', '2014-11-26 17:56:45', '2015-09-06 12:41:53', 2, ''),
