(117, 0, 'kreslo-grusha-zebra', '', '', '0', '15,16,17', 'kreslo-grusha-zebra', '', '0.00', 'Россия, Краснодар', '', 'гранулы пенополистерола.', '0', '<p>Мягкое и уютное кресло мешок груша! Внешний чехол из средне ворсового приятного на ощупь велюра! Велюр мебельный, высококачественный, износостойкий. Внешний чехол съемный на молнии, для удобства в уходе. Внутренний чехол из прочного спандбонда с застежкой-молнией. У кресла есть ручка для удобства переноски. В качестве наполнителя - гранулированный пенополистирол.</p><p> <br></p>', 1, '0', '', 'Кресло груша Зебра', '17', 'file_31_526_549be6af6b416', 1160, '1', '2014-12-25 13:28:36', '2015-09-06 12:41:53', 2, ''),
(119, 0, 'Кресло мешок Пингвин', '', '', '1', '19', 'kreslo-meshok-pingvin', '', '3990.00', 'Россия, Краснодар', '', 'гранулы пенополистерола.', '0', '<p>Кто сказал что мягкие игрушки не функциональны?!<br>Мы готовы поспорить!)<br>Кресло мешок-игрушка Пингвин порадует Вашего ребенка,да и не оставит в равнодушных ни одного взрослого)<br>Выполнен из мебельного велюра и имеет два чехла.<br>Отличный подарок на любой праздник!<span></span></p>', 1, 'black', '', 'Кресло мешок Пингвин', '17', 'file_31_526_54f57ffe3b7b9', 1180, '1', '2015-03-03 12:35:02', '2015-09-06 12:41:53', 2, ''),
(121, 0, '', '', '', '', '21', 'kreslo-meshok-perl', '', '0.00', 'Краснодар,Россия', '', 'гранулы пенополистирола 3-5  мм.', '0', '<p>Кресло мешок Перл это бескаркасное кресло имеющее вид обычного каркасного кресла,но при этом обладающее всеми функциями кресла мешка,а также его мягкостью и удобством.</p><p>Кресло мешок Перл подчеркнет Ваш интерьер и украсит любую квартиру.Отлично подходит для общественных заведений.</p>', 2, 'red', '', 'Кресло мешок Перл', '25', 'file_31_526_54feedfd02088', 1190, '1', '2015-03-10 16:18:28', '2015-03-10 16:18:28', 2, ''),
(122, 0, 'kreslo-meshok-perl', '', '', '', '21', 'kreslo-meshok-perl', '', '0.00', 'Краснодар,Россия', '', 'гранулы пенополистирола 3-5 мм.', '0', '<p>Кресло мешок Перл это бескаркасное кресло имеющее вид обычного каркасного кресла,но при этом обладающее всеми функциями кресла мешка,а также его мягкостью и удобством.</p><p>Кресло мешок Перл подчеркнет Ваш интерьер и украсит любую квартиру.Отлично подходит для общественных заведений.</p>', 2, 'blue', '', 'Кресло мешок Перл', '25', 'file_31_526_54feef261030d', 1200, '1', '2015-03-10 16:19:45', '2015-09-06 12:41:53', 2, ''),
(123, 0, '', '', '', '', '21', 'kreslo-meshok-perl', '', '0.00', 'Краснодар,Россия', '', 'гранулы пенополистирола 3-5 мм.', '0', '<p>Кресло мешок Перл это бескаркасное кресло имеющее вид обычного каркасного кресла,но при этом обладающее всеми функциями кресла мешка,а также его мягкостью и удобством.</p><p>Кресло мешок Перл подчеркнет Ваш интерьер и украсит любую квартиру.Отлично подходит для общественных заведений.</p>', 2, '0', '', 'Кресло мешок Перл', '25', 'file_31_526_54feef73161fb', 1210, '1', '2015-03-10 16:20:47', '2015-09-06 12:41:53', 2, ''),
(124, 0, '', '', '', '', '15,16,17', 'kreslo-meshok-aura', '', '0.00', 'Краснодар,Россия', '', 'Гранулы пенополистирола 3-5 мм.', '0', '<p>Кресло мешок Аура изготовлено из приятного на ощупь микровелюра.</p><p>Коллекция Aura — оригинальный микровелюр, который отличает высокое качество в сочетании с необычными цветовыми решениями. В коллекции можно найти яркие, сочные цвета в сочетании с нежными пастельными оттенками. Коллекция Aura оживит ваш дом, создаст атмосферу беззаботности и праздника, позволит создать уникальный, запоминающийся интерьер.<span></span><br></p>', 2, '0', '', 'Кресло мешок Аура', '17', 'file_31_526_54fef0e74b287', 1220, '1', '2015-03-10 16:29:15', '2015-03-10 16:29:15', 2, ''),
(125, 0, 'kreslo-grusha-rim', '', '', '1', '15,16,17', 'kreslo-grusha-rim', '', '0.00', 'Краснодар,Россия', '', 'гранулы пенополистирола', '49', '<p>Кресло груша Rim подойдет для создания современных стильных интерьеров и послужит великолепным инструментом для тех, кто любит быть в центре внимания и не боится экспериментов в интерьере.<span></span></p>', 2, '0', '', 'Кресло груша Рим', '17', 'file_31_526_54fef1c4ec911', 1230, '1', '2015-03-10 16:31:39', '2015-09-06 12:41:53', 2, ''),
(127, 0, '', '', '', '', '23', 'granuly-penopolistirola', '', '0.00', 'Россия, Краснодар', '', 'гранулы пенополистерола.', '0', '<p>Ваше любимое кресло-мешок просело?!(</p><p>Не расстраивайтесь!У нас можно приобрести качественный наполнитель для досыпки.Размер гранул 3-5мм.</p><p>100 литров хватит чтоб досыпать в 1 кресло.</p>', 3, '0', '', 'Гранулы пенополистирола', '26', 'file_31_526_5506f78a4d957', 1250, '1', '2015-03-16 18:35:39', '2015-03-16 18:35:39', 2, ''),
(128, 0, '', '', '', '', '24', 'gra', '', '0.00', 'Россия, Краснодар', '', 'гранулы пенополистерола.', '0', '<p>Ваше любимое кресло-мешок просело?!(</p><p>Не расстраивайтесь!У нас можно приобрести качественный наполнитель для досыпки.Размер гранул 3-5мм.</p><p>200 литров хватит чтоб досыпать в 2-3 кресла.</p>', 3, '0', '', 'Гранулы пенополистирола', '26', 'file_31_526_5506f8637de88', 1260, '1', '2015-03-16 18:36:41', '2015-03-16 18:36:41', 2, ''),
(129, 0, '', '', '', '', '25', 'g', '', '0.00', 'Россия, Краснодар', '', 'гранулы пенополистерола.', '0', '<p>Ваше любимое кресло-мешок просело?!(</p><p>Не расстраивайтесь!У нас можно приобрести качественный наполнитель для досыпки.Размер гранул 3-5мм.</p><p>300 литров хватит чтоб заполнить целое кресло или досыпать в 3-5 кресел.</p>', 5, '0', '', 'Гранулы пенополистирола', '26', 'file_31_526_5506f88b7d44d', 1270, '1', '2015-03-16 18:38:06', '2015-03-16 18:38:06', 2, ''),
(132, 0, 'kreslo-meshok-romb', '', '', '', '22', 'kreslo-meshok-romb', '', '0.00', 'Россия, Краснодар', '', 'гранулы пенополистерола.', '0', '<p>Если Вам необходимо создать современный стиль в интерьере, то это кресло-мешок именно для Вас!<span></span></p><p>Водоотталкивающая ткань,яркие принты....что еще нужно?!</p><p>В этом кресле уютно себя чувствовать будет любой человек,его высота 140 см.,а диаметр 105 см.</p>', 2, '0', '', 'Кресло мешок Ромб', '16', 'file_31_526_5508708605410', 1290, '1', '2015-03-17 21:28:15', '2015-09-06 12:41:53', 2, ''),
