(145, 0, 'Кресло мешок краснодар', '', '', '', '26,27', 'kreslo-grusha-safari-sanni', '', '0.00', 'Россия, Краснодар', '', 'гранулы пенополистерола', '0', '', 1, '0', '', 'Кресло груша Сафари санни', '15', 'file_31_526_55129f790ba19', 1360, '1', '2015-03-25 14:44:24', '2015-09-06 12:41:53', 2, ''),
(146, 0, 'kreslo_meshok_afrika', '', '', '1', '15,16,17', 'kreslo_meshok_afrika', '', '0.00', 'Россия, Краснодар', '', 'гранулы пенополистерола', '0', '<p>Кресло мешок Африка это не просто кресло...это украшение Вашего интерьера.</p><p>Это мягкая,удобная,модная и яркая груша подчеркнет Ваш интерьер и добавит в него чуточку \"пряности\".</p><p>Внешний чехол из плотной ткани скотчгард.Основные преимущества которого это влагозащита и яркие долговечные цвета.</p>', 1, '0', '', 'Кресло мешок Африка', '16', 'file_31_526_55130d09cc493', 1370, '1', '2015-03-25 22:32:08', '2015-09-06 12:41:53', 2, ''),
(148, 0, '', '', '', '', '15,16,17', 'kreslo-grusha-vera', '', '0.00', 'Россия, Краснодар', '', 'гранулы пенополистерола', '0', '', 1, '0', '', 'Кресло груша Вера', '17', 'file_31_526_55130e348db70', 1380, '1', '2015-03-25 22:41:33', '2015-03-25 22:41:33', 2, ''),
(153, 0, 'kreslo_meshok_krasnodar', '', '', '1', '15,16,17', 'kreslo-meshok-kets', '', '0.00', 'Краснодар, Россия', '', 'гранулы пенополистирола 3-5 мм.', '0', '<p>Это кресло-мешок сделано для детей.Именно поэтому оно самое мягкое,яркое и красочное из всей нашей коллекции!</p><p>Материал : Микровелюр - самый мягкий мебельный материал,сев в который вставать больше не захочется никогда.</p><p>Кроме мягкости кресло понравится своему маленькому хозяину рисунком и яркими цветами : бежевый,голубой и сиреневый.</p><p><img src=\"/public/img_lib/c70f4a70b3cec7703ebd453062a99b98.jpg\"></p>', 5, '0', '', 'Кресло мешок Кэтс', '17', 'file_31_526_55a78e82390f4', 1390, '1', '2015-07-16 14:07:59', '2015-09-06 12:41:53', 2, ''),
(154, 0, 'Kreslo_grusha_krasnodar', '', '', '', '15,16,17', 'kreslo-meshok-margaretta', '', '0.00', 'Краснодар', '', 'гранулы пенополистирола', '0', '<p>Маргарэтта-это не просто кресло мешок,это очень интересный аксессуар и уникальное интерьерное решение.</p><p>Изготовлено из 100% хлопка с рисунком в виде срубов деревьев.</p>', 2, '0', '', 'Кресло мешок Маргарэтта', '17', 'file_31_526_55a9097b330d7', 1400, '1', '2015-07-17 17:05:09', '2015-07-17 17:05:09', 2, ''),
(155, 0, '', '', '', '', '15,16,17', 'kreslo-meshok-art', '', '0.00', 'Краснодар', '', 'гранулы пенополистирола', '0', '<p>В этом кресле сочетаются все модные тенденции...прямые линии, геометрические узоры и цветы.</p><p>А также самые популярные в этом сезоне цвета: тёмно-фиолетовый и фисташковый.</p><p><img src=\"/public/img_lib/f2445ad4f773362bb441b56121ddfde5.jpg\"></p>', 2, '0', '', 'Кресло мешок Арт', '16', 'file_31_526_55a90b97be52b', 1410, '1', '2015-07-17 17:26:34', '2015-07-17 17:26:34', 2, ''),
(156, 0, 'kreslo-meshok-maki-red', '', '', '', '15,16,17', 'kreslo-meshok-maki-red', '', '0.00', 'Краснодар', '', 'гранулы пенополистирола', '0', '<p>Это яркое кресло станет необычным дополнением к интерьеру и оживит его.</p>', 2, '0', '', 'Кресло мешок Маки рэд', '17', 'file_31_526_55b0e12c525ce', 1420, '1', '2015-07-23 15:49:36', '2015-07-23 15:49:36', 2, ''),
(157, 0, 'Кресло мешок маки краснодар', '', '', '', '15,16,17', 'kreslo-meshok-maki-rouz', '', '0.00', 'Краснодар', '', 'гранулы пенополистирола', '0', '<p><br></p>', 2, '0', '', 'Кресло мешок Маки роуз', '17', 'file_31_526_55b0e3248c0b6', 1430, '1', '2015-07-23 15:51:35', '2015-09-06 12:41:53', 2, '');
INSERT INTO `db_mdd_team` (`id`, `meta`, `meta_title`, `meta_robots`, `meta_keywords`, `meta_description`, `name`, `system`, `position`, `desc`, `img`, `ord`, `visible`, `created`, `updated`, `uid`, `gid`) VALUES
(1, 0, 'Врач-стоматологи Мыльцев Е.В. - главный врач стоматологии M-Denta', 'index,follow', '', 'Мыльцев Евгений Владимирович - Главный врач Авторской стоматологической клиники \"M-Denta\" в Краснодаре, Врач-стоматолог ортопед, хирург, имплантолог, терапевт.', 'Мыльцев Евгений Владимирович', 'mylcev-evgenij-vladimirovich', 'Врач-стоматолог ортопед, хирург, имплантолог, терапевт.', '<p>1. Эстетическое протезирование по технологии Captek (Вена).</p>\n<p>2. Имплантология и протезирование на имплантатах (Бухарест)</p>\n<p>3. Эстетическое протезирование цельнокерамическими конструкциями (Дубай).</p>\n<p>4. Протезирование на имплантатах с немедленной нагрузкой (Будапешт).</p>\n<p>5. Особенности немедленной нагрузки (Ростов-на-Дону).</p>\n<p>6. Эстетическое протезирование с использованием конструкций из диоксида циркония (Анталия).</p>\n<p>7. Клинические особенности при полном протезировании на имплантатах (Цюрих).</p>\n<p>8. Протезирование винирами (Мюнхен).</p>\n<p>9. Протезирование металлокерамическими конструкциями (Гамбург).</p>\n<p>10. Дентальная имплантация и протезирование на имплантатах (Москва).</p>\n<p>11. Протезирование безметалловыми конструкциями (Гамбург).</p>\n<p>12. Прогрессивные методики трансплантации твёрдых и мягких тканей. Трёхмерная реконструкция дефектов, туннельная техника, синуслифтинг и имплантация в сложных клинических случаях (Краснодар).</p>\n<p>13. Эстетика и предсказуемость: хирургические и ортопедические аспекты практической имплантологии (Анапа).</p>\n<p>14. ROAD SHOW NOBEL BIOCARE (Геленджик).</p>\n<p>15. Treatment planning in the age of implant dentistry (Краснодар).</p>\n<p>16. Modern methods of bone and soft tissue transplantation. Predictable esthetic and stable results in implantology (Краснодар).</p>\n<p>17. Clinical aspects of implant treatment plans in the complex prosthodontic treatment (Краснодар).</p>\n<p>18. Zirkonoxid-Technology (Краснодар).</p>\n<p>19. Clincal aspects of conservative periodontology and oriented implant prosthesses (Краснодар).</p>\n<p>20. Протезирование полными съёмными протезами (Вена).</p>\n<p>21. Протезирование полными съёмными протезами по системе Ivocap (Дортмунд).</p>\n<p>22. Телескопические бюгельные протезы (Москва).</p>\n<p>23. Применение увеличительной техники в стоматологии (Санкт-Петербург).</p>\n<p>24. MIS Global conference 2013 (Канны).</p>\n<p>25. Решение окклюзионных проблем с помощью лицевой дуги и артикулятора в ежедневной работе клиники и лаборатории (Краснодар).</p>\n<p>26. Seminar in implant dentistry, School of Graduate Dentistry Rambam Health Care Campus Faculty of medicine - Technion I.I.T. (Хайфа, Израиль).</p>\n<p>27. Симпозиум Nobel Biocare (Сочи).</p>\n<p>28. Национальный симпозиум \"Остеология\" (Москва).</p>\n<p>29. Конгресс:10 лет Nobel Biocare в России. Опыт, развитие и инновации (Москва).</p>\n<p>30. Немедленная нагрузка в различных клинических случаях. Функциональный и эстетический результат (Краснодар).</p>', 'file_65_1086_5bd6dd51dc46e', 10, 1, 1540808091, 1540808091, 2, 0),
(2, 0, '', '', '', '', 'Карагодина Наталья Владимировна', 'karagodina-natalya-vladimirovna', 'Гигиенист. Ассистент стоматолога.', '', 'file_65_1086_5bd6dda034b68', 40, 1, 1540808128, 1540808128, 2, 0),
(3, 0, 'Врач-стоматолог ортодонт, гнатолог - Андреева В.Н.', 'index,follow', '', 'Специалиста стоматологии M-Denta в Краснодаре - Андреева В.Н. - Врач-стоматолог ортодонт, гнатолог.', 'Андреева Вера Николаевна', 'andreeva-vera-nikolaevna', 'Врач-стоматолог ортодонт, гнатолог.', '<p>1. 2003 г. — сертификат классической эндодонтии Иерусалимского университета, д-р М. Соломонов.</p>\n<p>2. 2003 г. — участник съезда эндодонтов Юга России, г. Анапа.</p>\n<p>3. 2005 г. — сертификат по новым методам лечения в эндодонтии Иерусалимского университета, д-р М. Соломонов.</p>\n<p>4. 2006 г. — сертификат по перелечиванию в эндодонтии Иерусалимского университета, д-р М. Соломонов.</p>\n<p>5. 2007 г. — сертификат по специальным вопросам в области эндодонтии Иерусалимского университета, д-р М. Соломонов.</p>\n<p>6. 2006 г. — участник семинара по отбеливанию зубов по технологиям Discus Dental — Day White, Nite White, Zoom Weekender. Мастер-класс часовой клинической системой ZOOM2 с получением сертификата, г. Москва.</p>\n<p>7. 2005 г. — участник семинара по ортопедической стоматологии: «Использование цифровой фотографии для точной передачи цвета реставрации. Прибор для определения цвета зубов — EasyShade», мастер-техник В. Шиноян (Швейцария), г. Краснодар.</p>\n<p>8. 2005 г. — Участник симпозиума «Достижение эстетики мягких тканей при протезирования на имплантатах». Д-р О. Юксель г. Краснодар.</p>\n<p>9. 2006 г. — Участник симпозиума «Эстетическое протезирование на имплантатах системы Astra Tech.». Д-р А.Тулберг (Швейцария) г. Москва.</p>\n<p>10. 2006 г. — Лекционный курс по ортопедической стоматологии «Особенности бюгельного протезирование.». Д-р К-П. Мешке.(Германия, Вупперталь) г. Краснодар.</p>\n<p>11. 2006 г. — Сертификат участника Международного Симпозиума по Стоматологии — Квинтэссенция. г. Москва.</p>\n<p>12. 2006 г. — Сертификат участника конференции по ортопедической стоматологии 3M ESPE. г. Москва.</p>\n<p>13. 2007 г. — Участник семинара по терапевтической стоматологии 3M ESPE «Функциональные и эстетические аспекты восстановления угла коронковой части фронтального зуба. Восстановление контактного пункта (активная методика). Выбор аксессуаров при работе с композитными материалами» д-р Ломакова. г. Москва.</p>\n<p>14. 2007 г. — Сертификат участника конференции по ортопедической стоматологии 3M ESPE. г. Москва.</p>\n<p>15. 2007 г. — Участник конференции «Оксид циркония в ортопедической стоматологии» Мастер-класс «Техника работы с современными керамическими материалами. Единая схема работы с каркасами из металла, безметалловых материалов In-Ceram (оксид алюминия) и диоксида циркония» Мастер-техник Петра Колхас (Германия) г. Москва</p>\n<p>16. 2007 г. — 2009 учеба в Donau – Universitaet Krems/ Gnatology/ Dr.Pf.Slavichek. Австрия. Вена. Кремс. на отделении \"Function and disfunction of masticatory organ\" ( функция и дисфункция жевательного органа) присвоена квалификация : «Академический эксперт в области функциии дисфункции жевательного органа»</p>\n<p>17. 2008 г. — сертификат участника теоретического и практического семинара по имплантологии на основе системы имплантации «Alpha Bio» (Израиль) г.Москва</p>\n<p>18. 2008 г. — член Международной Академии Передовой Междисциплинарной Стоматологии (International Academy of Advanced Interdisciplinary Dentistry)</p>\n<p>19. 2008 г. — сертификат участника международной конференции в области ортодонтии и гнатологии «Concensus Conferensus» Австрия. Кремс.</p>\n<p>20. 2008 г. — 2009 г – стажировка в частной клинике - Medeco Dental Clinic/Dental Clinic for Craniofacial and OcclusionMedicine, Bonn, Germany.</p>\n<p>21. 2010-2014 — учеба в Vienna School of Interdisciplinary Dentistry на отделении \"Orthodontics in Craniofacial Dysfunctions\" ( ортодонтическая реабилитация кранио- мандибулярных дисфункций) под руководством Prof. Sadao Sato.</p>\n<p>22. 2016 — сертификат участника конференции в области цифровой стоматологии Sirona ( Краснодар).</p>\n<p>23. 2017 — сертификат участника научно-клинической конференции « Стоматология и Окклюзионная медицина» (Москва).</p>', 'file_65_1086_5bd70afff1344', 20, 1, 1540819758, 1540819758, 2, 0),
(4, 0, 'Зубной техник - Мыльцев В.А.', 'index,follow', '', 'Специалист стоматологической клиники М-Дента - Мыльцев Владимир Александрович - зубной техник.', 'Мыльцев Владимир Александрович', 'mylcev-vladimir-aleksandrovich', 'Зубной техник.', '<p>1. Применение керамической массы Nori Take при изготовлении металлокерамических конструкций (Дубай).<br>2. Бюгельные протезы с телескопической фиксацией (Москва).<br>3. Протезирование полными съёмными протезами по системе Ivocap (Дортмунд).<br>4. CAD/CAM технологии (Москва).<br>5. Эстетическое протезирование с использованием конструкций из диоксида циркония (Анталия).<br>6. Особенности нанесения керамической массы IPS e.max (Москва).<br>7. Протезирование винирами (Мюнхен).<br>8. Особенности изготовления металлокерамических и безметалловых конструкций на имплантах (Брюссель).<br>9. Работа с анатомическим артикулятором (Вена).<br>10. Применение увеличительной техники в стоматологии (Санкт-Петербург).</p>\n<p>11. Особенности работы с керамической массой IPS e.max. Жеральд Убасси (Франция, Ровшор Дю Гар).</p>', 'file_65_1086_5bd70b3ea51da', 30, 1, 1540819827, 1540819827, 2, 0),
