INSERT INTO `db__seo_counters_type` (`id`, `system`, `name`, `template`) VALUES
(1, 'yandex', 'Yandex.Metrika', '<a href=\"https://metrika.yandex.ru/stat/?id=%code%&amp;from=informer\"\r\ntarget=\"_blank\" rel=\"nofollow\"><img src=\"//bs.yandex.ru/informer/%code%/3_1_FFFFFFFF_FFFFFFFF_0_pageviews\"\r\nstyle=\"width:88px; height:31px; border:0;\" alt=\"Яндекс.Метрика\" title=\"Яндекс.Метрика: данные за сегодня (просмотры, визиты и уникальные посетители)\" onclick=\"try{Ya.Metrika.informer({i:this,id:%code%,lang:\'ru\'});return false}catch(e){}\"/></a>\r\n\r\n<script src=\"//mc.yandex.ru/metrika/watch.js\" type=\"text/javascript\"></script>\r\n<script type=\"text/javascript\">\r\ntry { var yaCounter%code% = new Ya.Metrika({\r\n	id:%code%,\r\n	webvisor:true, //Вебвизор\r\n	clickmap:true, //Карта кликов\r\n	trackLinks:true, //Внешние ссылки, загрузки файлов и отчёт по кнопке «Поделиться»\r\n	accurateTrackBounce:true, //Точный показатель отказов\r\n	trackHash:true, //Отслеживание хеша в адресной строке браузера\r\n	ut:\"noindex\" //Запрет отправки на индексацию страниц сайта.\r\n});\r\n} catch(e) { }\r\n</script>\r\n<noscript><div><img src=\"//mc.yandex.ru/watch/%code%?ut=noindex\" style=\"position:absolute; left:-9999px;\" alt=\"\" /></div></noscript>'),
(2, 'google', 'Google.Analytics', '<script>\r\n(function(i,s,o,g,r,a,m){i[\'GoogleAnalyticsObject\']=r;i[r]=i[r]||function(){\r\n(i[r].q=i[r].q||[]).push(arguments)},i[r].l=1*new Date();a=s.createElement(o),\r\nm=s.getElementsByTagName(o)[0];a.async=1;a.src=g;m.parentNode.insertBefore(a,m)\r\n})(window,document,\'script\',\'//www.google-analytics.com/analytics.js\',\'ga\');\r\nga(\'create\', \'%code%\', \'auto\');\r\nga(\'send\', \'pageview\');\r\n</script>'),
(3, 'li', 'LiveInternet', '<script>\r\ndocument.write(\"<a href=\'http://liveinternet.ru/click\' target=\'_blank\'><img src=\'//counter.yadro.ru/hit?t14.3;r\" + escape(document.referrer)+((typeof(screen)==\"undefined\")? \"\" : \";s\"+screen.width+\"*\"+screen.height+\"*\"+(screen.colorDepth ? screen.colorDepth:screen.pixelDepth))+\";u\"+escape(document.URL)+\";\" + Math.random()+ \"\' alt=\'\' border=\'0\' width=\'88\' height=\'31\'><\\/a>\")\r\n</script>'),
(4, 'hotlog', 'Hotlog', '<span id=\"hotlog_counter\"></span>\r\n<span id=\"hotlog_dyn\"></span>\r\n<script type=\"text/javascript\">\r\nvar hot_s = document.createElement(\'script\');\r\nhot_s.type = \'text/javascript\'; hot_s.async = true;\r\nhot_s.src = \'http://js.hotlog.ru/dcounter/%code%.js\';\r\nhot_d = document.getElementById(\'hotlog_dyn\');\r\nhot_d.appendChild(hot_s);\r\n</script>\r\n<noscript><a href=\"http://click.hotlog.ru/?%code%\" target=\"_blank\"><img src=\"http://hit41.hotlog.ru/cgi-bin/hotlog/count?s=%code%&amp;im=357\" border=\"0\" alt=\"HotLog\"></a></noscript>'),
(5, 'spylog', 'SpyLog', '<span id=\"openstat1\"></span>\r\n<script type=\"text/javascript\">\r\nvar openstat = { counter: 1, next: openstat };\r\n(function(d, t, p) {\r\nvar j = d.createElement(t); j.async = true; j.type = \"text/javascript\";\r\nj.src = (\"https:\" == p ? \"https:\" : \"http:\") + \"//openstat.net/cnt.js\";\r\nvar s = d.getElementsByTagName(t)[0]; s.parentNode.insertBefore(j, s);\r\n})(document, \"script\", document.location.protocol);\r\n</script>');
