(47, 150, 'ru', '<div class=\"text_content\">\n	<p>Наша клиника имеет самое передовое и инновационное оснащение во всех сферах стоматологии.</p>\n	<p>Мы проводим лечение и имплантацию зубов любой сложности, в том числе восстановление зубного ряда даже при полной адентии (отсутствии зубов) за один визит к стоматологу.</p>\n	<p>Стоматология \"M-Denta\" имеет собственную зуботехническую лабораторию в помещении клиники, поэтому мы гарантируем качество всех ортопедических конструкций и непосредственный 	тщательный 	контроль со стороны доктора при их исполнении.</p>\n	<p>Обратившись в нашу клинику, вы можете быть уверены в получении стоматологических услуг самого высокого уровня.</p>\n</div>'),
(52, 154, 'ru', ' <section class=\"gnatalogy\">\n        <h1 class=\"black-centre-24\">Гнатология в Краснодаре</h1>\n        <div class=\"container-flex-2\">\n            <img src=\"img/gnatology.png\" alt=\"Гнатология в Краснодаре\" title=\"Гнатология в Краснодаре\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Пациенты, которые обращаются с болями и проблемами к стоматологу, и не подозревают, что в ряде случаев необходима дополнительная консультация у врача-гнатолога. Вот, кто это такой и чем полезен.</p>\n                <p><strong>Если упростить, то гнатология - наука, которая изучает связь работы челюстей с остальным организмом: как они вместе правильно или неправильно работают.</strong></p>\n                <p><strong>Исследования специалиста-гнатолога помогают при профилактических мерах и лечении заболеваний височно-нижнечелюстного сустава.</strong></p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <h2>О посещении гнатолога задумываются, если:</h2>\n            <ul>\n                <li>Боль при открывании рта или жевании отдаёт в шею, руки или голову.</li>\n                <li>Трудно двигать челюстью.</li>\n                <li>Зубы не смыкаются до конца.</li>\n                <li>Шумит в ушах.</li>\n                <li>Сводит мышцы лица, шеи, плечевого пояса.</li>\n                <li>Болит голова.</li>\n                <li>Мучает храп.</li>\n            </ul>\n            <p>Все эти симптомы – следствия сбоя в работе механизмов не только зубов, но и всех систем лица и головы. Врач-гнатолог, как опытный механик, внимательно диагностирует стоматогнатическую систему и находит причину «поломки».</p>\n            <p><strong>Гнатология налаживает работу челюстно-лицевого аппарата с другими системами и органами. Без функциональной диагностики и гнатологии невозможно составить грамотный план лечения и гарантировать долговечный результат. </strong></p>\n        </div>\n\n         <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Междисциплинарное взаимодействие и комплексный подход к стоматологическому лечению.</h2>\n            <p>Все эти симптомы – следствия сбоя в работе механизмов не только зубов, но и всех систем лица и головы. Врач-гнатолог, как опытный механик, внимательно диагностирует стоматогнатическую систему и находит причину «поломки».</p>\n            <p><strong>Гнатология налаживает работу челюстно-лицевого аппарата с другими системами и органами. Без функциональной диагностики и гнатологии невозможно составить грамотный план лечения и гарантировать долговечный результат. </strong></p>\n         </div>   \n            <div class=\"container-812\">\n                <ul>\n                    <li>Первичный осмотр.</li>\n                    <li>Рентгенологическое исследование.</li>\n                    <li>Компьютерное исследование суставов ВНЧС.</li>\n                    <li>Изготовление диагностических моделей.</li>\n                    <li>Окклюзиограмма.</li>\n                    <li>Исследование и диагностика brux-checker.</li>\n                    <li>Исследование жевательных мышц.</li>\n                    <li>Консультации стоматологов смежных клинических дисциплин.</li>\n                </ul>\n            </div>\n            <div class=\"container-812\">\n            	 <p><strong>Цель междисциплинарного подхода состоит в том, чтобы комплексно восстанавливать и сохранять функции речи, жевания и глотания, а не лечить отдельно суставы и зубы. </strong></p>\n            </div>\n            \n           \n \n        <div class=\"gnatalogy-wrapper\"></div>\n\n        <div class=\"container-812\">\n             <h2 class=\"red-centre-bold\">Функциональная диагностика окклюзии и ВНЧС</h2>\n             <p>Строение сетчатки глаз, рисунок на подушечках пальцев уникальны. Движения челюстей также индивидуальны. </p>\n             <p>Когда пациент обращается в клинику с жалобами на челюстные суставы, неправильный прикус, отсутствие зубов, врач-гнатолог сначала проводит функциональную диагностику. Её результаты предоставляют стоматологу ясную картину о строении зубов, прикусе, работе суставов.</p>\n             <p>Согласно этой информации, составляют план лечения. Вот как он выглядит в ряде случаев:</p>\n             <ul>\n                 <li>Полный медицинский анамнез.</li>\n                 <li>Внутри-и вне-ротовые фотографии).</li>\n                 <li>Проверка мышц шеи и головы.</li>\n                 <li>Снятие высокоточных слепков и изготовление диагностических моделей.</li>\n                 <li>Анализ окклюзиограммы (bruxcheker day/night).</li>\n                 <li>Цефалометрический анализ.</li>\n                 <li>Анализ рентгенограммы (прицельные снимки, ортопантомограмма, МРТ, Томография, КТ).</li>\n                 <li>Наложение лицевой дуги и кондилография.</li>\n                 <li>Анализ моделей в артикуляторе.</li>\n                 <li>Компьютерный анализ данных в CADIAX (Pr. Rudolf Slavicek).</li>\n             </ul>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <img src=\"img/gnatology2.png\" alt=\"gnatalogy\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Работа стоматолога, ортопеда и гнатолога в команде, диагностика и обмен опытом обеспечивают результативное лечение и восстановление зубов, суставов и прикуса с опорой на индивидуальные особенности строения костей лица и головы.</p>\n                <p>В результате пациент гордится здоровой и гармоничной улыбкой.</p>\n            </div>\n        </div>\n\n    </section>'),
(54, 155, 'ru', '<h1>Имплантация зубов в Краснодаре</h1>\n<div class=\"flex-container implant-block\">\n	<div class=\"w30\">\n		<img src=\"/img/implantaciya-teeth.png\" alt=\"Дентальный имплантат Nobel Biocare\" title=\"Дентальный имплантат Nobel Biocare\">\n	</div>\n    <div class=\"w70\">\n    	<p>Стоматология «M-Denta» занимается дентальной имплантацией в Краснодаре с 2005 года. За время работы специалисты нашей стоматологической клиники накопили значительный опыт в этой области, прошли стажировки у ведущих международных стоматологов, в том числе у Паоло Мало - изобретателя инновационной методики дентальной имплантологии – All-on-4. </p>\n        <p>В своей работе мы доверяем производителям с мировым именем: Nobel Biocare и MIS.\nОпыт и передовые технологии имплантации гарантируют самый высокий результат у пациентов с клиническими случаями любой сложности.</p>\n    </div>\n</div>'),
(58, 158, 'ru', '<section class=\"implantacia\">\n\n        <div class=\"container-812\">\n        	<a class=\"nav-link\" href=\"/implantaciya-zubov\" alt=\"Имплантация зубов\"><< Имплантация зубов</a>\n            <h1 class=\"black-centre-24\">Имплантация зубов Всё на четырёх (All on 4) в Краснодаре</h1>\n            <p>All-on-4® - инновационная методика лечения от швейцарской компании Nobel Biocare. Это концепция лечения при полной адентии, которая предусматривает установку имплантатов с моментальной нагрузкой.</p>\n        </div>\n\n        <p class=\"red-centre-bold\"></p>\n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/new/all4-1.jpg\" alt=\"Имплантация все на четырех в Краснодаре\" title=\"Имплантация все на четырех в Краснодаре\">\n            <div class=\"container-flex-2-info__text\">\n                <p>В 1995 г. профессор-стоматолог из Португалии по имени Паоло Мало основывает собственную клинику, где разрабатывает и описывает технику лечения полной адентии с использованием имплантов с немедленной нагрузкой без сину-лифтинга.</p>\n                <p>В 1998 г. Паоло Мало впервые применяет описанный им план лечения на практике.</p>\n                <p>Вот что говорит сам автор концепции: «Использование четырех имплантатов снижает сложность лечения, что дает много преимуществ. Затраты как для врача, так и для пациента уменьшаются, потому что используются меньше времени и продуктов. Выгода также состоит в снижении сложности при изготовлении протеза, что приводит к более предсказуемым шаблонам рабочих процессов. Использование концепции пациентом предусматривает несложную гигиену, что улучшает здоровье полости рта».</p>\n                <p>В 2004 г. Nobel Biocare с разрешения Паоло Мало запускает концепцию лечения All-on-4® на собственных имплантах.</p>\n            	<p>В 2015 г. проводится 34 научных исследования с 2 000 пациентов. Концепция доказывают свою эффективность.</p>\n            </div>\n        </div>\n\n         <div class=\"container-812\">\n            <p>В 2016 г. стоматологи возвращают более 100 000 пациентам по всему миру радость здоровой улыбки с помощью All-on-4® на имплантатах Nobel Biocare.</p>\n            <h2 class=\"red-centre-bold\">Суть метода \"Всё на четырёх (All on 4)\"</h2>\n            <p>Смысл концепции All-on-4® на имплантатах Nobel Biocare при полном отсутствии зубов заключается в установке всего 4 имплантов для каждой челюсти и их нагрузке протезом за один приём у стоматолога. Кроме того, такой протокол предусматривает установку имплантатов без синус-лифтинга. </p>\n        </div>\n\n         <div class=\"container-flex-2\">\n            <img src=\"/img/new/all4-2.jpg\" alt=\"Метод имплантации Все на четырех\" title=\"Метод имплантации Все на четырех\">\n            <div class=\"container-flex-2-info__text\">\n                <h3><strong>Преимущества такого плана лечения: </strong></h3>\n                <ul>\n                    <li>Установка всего 4 имплантов: 2 передних устанавливаются в челюстную кость прямо, а два задних – под углом 45°. </li>\n                    <li>Немедленная установка временного протеза, если клиническая ситуация пациента это позволяет.</li>\n                    <li>Отсутствие синус-лифтинга. Угол наклона задних имплантов позволяет функционально использовать любой объём костной ткани.</li>\n                </ul>\n                 <p> <strong>Стоматологи авторской стоматологической клиники «M-Denta» проходили обучение протоколу All-on-4® на имплантатах Nobel Biocare у самого основателя – Паоло Мало.</strong></p>\n           		 <p>За 14 лет опыта мы избавили от полной адентии тысячи пациентов с применением этой техники. Швейцарское качество имплантов, ювелирное мастерство зубного техника и большой опыт стоматологов гарантируют здоровую улыбку. </p>\n            </div>\n        </div>\n\n    </section>'),
(65, 159, 'ru', '<section class=\"implantacia-mostovidniy\">\n  \n        <div class=\"container-812\">\n            <a href=\"/implantaciya-zubov\" class=\"nav-link\"><< Имплантация зубов</a>\n            <h2 class=\"black-centre-24\">Мостовидный протез</h2>\n            <p>Если в ряду не хватает больше одного зуба, разумным решением будет поставить мост на имплантах. </p>\n            <p>Мост – ортопедическая дентальная конструкция из искусственных зубов, которые выглядят как настоящие. Его фиксируют на нескольких имплантах. </p>\n        </div>\n        \n        <div class=\"container-flex-2\">\n            <img src=\"/img/impl-most.png\" alt=\"Установка мостовидного протеза в Краснодаре\" title=\"Установка мостовидного протеза в Краснодаре\">\n            <div class=\"container-flex-2-info__text\">\n                <p> <strong>Основные преимущества мостовидного протеза:</strong></p>\n                <ul>\n                    <li>Мост препятствует движению соседних зубов, то есть сохраняет прикус неизменным. </li>\n                    <li>Из-за крепления непосредственно к имплантатам соседние зубы не подвергаются давлению. </li>\n                    <li>Мостовидная дентальная конструкция полностью восстанавливает жевательную функцию, а правильные движения челюсти при жевании и материал поверхности импланта сохраняют имеющийся уровень костной ткани, препятствую её истончению. </li>\n                </ul>\n             </div>\n        </div>\n\n        <div class=\"container-812\">\n            <p> <strong>В Авторской стоматологической клинике применяют установку мостовидной ортопедической дентальной конструкции на имлантатах Nobel Biocare и MIS.</strong></p>\n        </div>\n\n    </section>'),
