(68, 161, 'ru', '    <section class=\"implantacia-sinus\">\n  \n        <div class=\"container-812\">\n            <a href=\"/implantaciya-zubov\" class=\"nav-link\"><< Имплантация зубов</a>\n            <h1 class=\"black-centre-24\">Синус-лифтинг</h1>    \n        </div>\n\n        <div class=\"container-flex-2\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Для того, чтобы имплант в десне устойчиво функционировал, в ней должно быть достаточное количество костной ткани. Часто к стоматологу обращаются спустя долгое время после потери зуба. К этому времени кость истончается, крошится. </p>\n                <p>Поэтому перед имплантацией добавляют недостающую ткань –  делают костную пластику.</p>\n                <p>В авторской стоматологической клинике «M-Denta» перед установкой импланта всегда проводится тщательная диагностика костной ткани. Если её не достаёт – назначается костная пластика. Только после этого фиксируют имплант.</p>\n            </div>\n            <img src=\"/img/new/sinus-1.jpg\" alt=\"Синус-лифтиг в Краснодаре\" title=\"Синус-лифтиг в Краснодаре\">\n        </div>\n\n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Причины недостатка костной ткани</h2>\n            <p>Процессы, приводящие к недостатку и сокращению количества костной ткани:</p>\n            <ul>\n                <li>Выпадение или удаление зуба. Пока зуб здоров, он передаёт часть нагрузки, связанной с измельчением и пережёвыванием пищи, на кость. Размер её и количество при этом остаются неизменными. При отсутствии зуба – давление на кость прекращается, она атрофируется.</li>\n                <li>Воспалительные процессы в области зуба, периодонтит, тоже приводят к тому, что количество костной ткани уменьшается.</li>\n                <li>Физическое воздействие на зубы, травмы приводят к истончению и сокращению количества костной ткани.</li>\n            </ul>\n            <p>Самостоятельно обнаружить недостаток кости при отсутствии зуба не составит труда: мягкая десна при лёгком надавливании свидетельствует о том, что твёрдых тканей осталось мало. Процесс восстановления костной ткани на верхней челюсти получил название синус-лифтинга. </p>\n        </div>\n\n        <h2 class=\"red-centre-bold\">Что такое синус-лифтинг</h2>\n    \n        <div class=\"container-flex-2\">\n            <img src=\"/img/new/sinus-2.jpg\" alt=\"sinus-lifting\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Это наращивание кости в верхней челюсти для того, чтобы в ней прочно держался имплант длиной до 10 мм.</p>\n                <p>Суть костной пластики заключается в смещении перегородки верхнечелюстной пазухи – синуса -  чтобы освободить место для заполнения искусственным костным материалом. После синус-лифтинга ткань становится плотной, объёмной и подходит для установки имплантата. </p>\n                <p>В авторской стоматологической клинике «M-Denta» перед имплантацией зуба проводят диагностику, чтобы узнать, хватит ли костной ткани для установки импланта. Если ткани недостаточно или она слабая – проводят синус-лифтинг.</p>\n                <p><strong>Вот основные этапы:</strong></p>\n                <p>1. Под местным обезболиванием делают надрез десны.</p>\n                <p>2. С помощью специального инструмента прокалывают костную ткань и фрезой поднимают небольшой участок перегородки верхнечелюстной пазухи.</p>\n                <p>3. Освободившееся пространство заполняют искусственным костным материалом.</p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n\n            <p>После того как затянутся постоперационные швы, исчезнут болевые ощущения устанавливают имплантаты. </p>\n        </div> \n    \n        <div class=\"wrapper\"></div>\n        \n        <div class=\"container-812\">\n            <p>Специфика синус-лифтинга предполагает как показания, так и противопоказания к его применению.</p>\n            <h3 class=\"red-centre-bold\">Показания</h3>\n            <p>Основное показание – отмирание костных тканей в боковых зубах верхней челюсти.  С помощью компьютерной томографии стоматолог определяет толщину кости на её пригодность к установке имплантата. Если она тоньше 10 мм – делают синус-лифтинг.</p>\n        </div>\n\n        <div class=\"wrapper-second\">\n            <div class=\"container-812\">\n                <h3 class=\"red-centre-bold\">Противопоказания</h3>\n                <p>Костная пластика не проводится, если:</p>\n                <ul>\n                    <li>нарушен обмен веществ;</li>\n                    <li>снижен иммунитет;</li>\n                    <li>плохая свёртываемость крови;</li>\n                    <li>злокачественные и доброкачественные опухоли;</li>\n                    <li>кости плохо восстанавливаются;</li>\n                    <li>аллергия на вещества, которые содержатся в обезболивающих препаратах;</li>\n                    <li>диагностировали ринит, синусит;</li>\n                    <li>обострениях хронических болезней;</li>\n                    <li>обнаружены заболевания сердечно-сосудистой системы;</li>\n                    <li>присутствует наркотическая, никотиновая или алкогольная зависимость;</li>\n                    <li>диагностировали СПИД;</li>\n                    <li>ненормальное развитие челюстно-лицевого аппарата или гайморовы пазухи расположены слишком близко друг к другу.</li>\n                </ul>\n            </div>\n        </div>\n        \n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Открытый и закрытый синус-лифтинг</h2>\n            <p>В авторской стоматологической клинике «M-Denta» костную пластику проводят двумя методиками: открытой и закрытой.</p>\n        </div>\n      \n        <div class=\"container-flex-2\">\n            <img src=\"/img/new/sinus-3.jpg\" alt=\"sinus-lifting\">\n            <div class=\"container-flex-2-info__text\">\n                <h3><strong>Открытый синус-лифтинг. </strong></h3>\n                <p>Это наиболее сложный с точки зрения проводимых манипуляций метод. Его используют, если толщина костной ткани верхней челюсти менее 7 мм.</p>\n                <p>Для этого десну прокалывают, отодвигают кость и специальным инструментом приподнимают часть перегородки верхнечелюстной пазухи. В образовавшуюся полость закладывают недостающий костный материал и накладывают швы.</p>\n                <p>Вставлять имплант после открытого синус-лифтинга можно через 5 месяцев.</p>\n                <h3><strong>Закрытый синус-лифтинг. </strong></h3>\n            	<p>Его назначают, если толщина кости более 7 мм. Преимущество такого способа состоит в том, что заполнение костной тканью и установку имплантата проводят одномоментно. Для этого место внедрения импланта прокалывают до стенки пазухи, затем приподнимают её и заполняют полость костной тканью. На последнем этапе устанавливают имплантат.</p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n\n            <p>После такого вмешательства жевать, говорить и работать челюстью в первое время рекомендуется осторожно и сильно её не нагружать. </p>\n        </div>\n\n        <div class=\"wrapper-second\">\n            <div class=\"container-812\">\n                <h4 class=\"red-centre-bold\">Реабилитация</h4>\n                <p>После синус-лифтинга нередко появляется отечность. Чтобы реабилитация прошла мягко, стоматологи рекомендуют в течение месяца придерживаться следующих правил:</p>\n                <ul>\n                    <li>Не летать на самолёте.</li>\n                    <li>Ограничить физическую активность.</li>\n                    <li>Не нырять.</li>\n                    <li>Запрещено сморкаться, громко чихать и кашлять. Если это необходимо – минимизировать давление: манипуляции проводить с открытым ртом и приложив к нему платок. </li>\n                    <li>Не переохлаждаться и не перегреваться. Исключить солярий, баню и сауну.</li>\n                    <li>Не пить через соломинку. Избегать горячего, холодного и твёрдого в еде.</li>\n                    <li>Не заниматься самолечением: при появлении тревожных симптомов – припухлость, сильная боль – сразу сообщать стоматологу. </li>\n                </ul>\n                <p>При соблюдении этих требований ускоряется заживление, и искусственный костный материал приживается хорошо. </p>\n                <p>Цена на костную пластику зависит от выбора способа: открытый или закрытый синус-лифтинг.</p>\n            </div>\n        </div>\n\n    </section>'),
(72, 162, 'ru', '<section class=\"implantacia-traditional\">\n  \n        <div class=\"container-812\">\n            <a href=\"/implantaciya-zubov\" class=\"nav-link\"><< Имплантация зубов</a>\n            <h2 class=\"black-centre-24\">Традиционная установка зубных имплантатов</h2>\n            <p>При использовании этого метода врачи-стоматологи уделяют особое внимание состоянию костной ткани челюсти пациента, так как классическая имплантация зубов предъявляет самые высокие требования к состоянию костной ткани. При недостатке кости для крепления имплантата проводится ее предварительное наращивание.</p>\n            <p>Следует также отметить, что по времени - это самый длительный метод имплантации.</p>\n            <h2 class=\"red-centre-bold\">Этапы классической имплантации</h2>\n            <h3><strong>1. Подготовка к имплантации.</strong></h3>\n            <p>На этом этапе пациент проходит полное обследование у стоматолога. Проводятся диагностические процедуры, делается нужное количество снимков. Только после получения полной информации о состоянии костной ткани и полости рта пациента врач-стоматолог составляет план лечения.</p>\n            <h3><strong>2. Удаление проблемных зубов и лечение проблемных участков полости рта.</strong></h3>\n            <p>Так как дентальная имплантация оказывает значительную нагрузку на полость рта и весь организм, то перед ней врач предварительно должен устранить все существующие стоматологические проблемы пациента. При обнаружении воспалительных процессов установку имплантатов откладывают до полного выздоровления.</p>\n            <p> Далее удаляется проблемный зуб или несколько зубов. После этого пациенту назначаются препараты и даются рекомендации для более комфортного прохождения следующего этапа - послеоперационной реабилитации.</p>\n        </div>\n        \n        <div class=\"wrapper\"></div>\n\n        <div class=\"container-812\">\n            <h3><strong>3. Заживление десны и восстановление костной ткани на месте удаленного зуба (зубов).</strong></h3>\n            <p>На этот этап требуется от 2-х до 4-х месяцев. Только убедившись, что десна полностью зажила и костная ткань восстановилась, стоматолог может приступать к следующему этапу. Иногда может потребоваться дополнительное время на заживление.</p>\n            <h3><strong>4. Хирургический этап имплантации зубов.</strong></h3>\n            <p>На этом этапе врач-стоматолог делает разрез десны и специальным инструментом препарирует ложе под имплантат. Затем имплантат вживляют в челюстную кость.Далее клиническая ситуация развивается двумя возможными вариантами:</p>\n            <ul>\n                <li>На имплант сверху устанавливается заглушка – тоненький вшиток. После её фиксации всё зашивают. Через 2-6 месяцев на это место устанавливается формирователь десны.</li>\n                <li>В другом случае формирователь десны ставится сразу же после вживления импланта. Он служит для формирования мягких тканей вокруг имплантата. </li>\n            </ul>\n            <p>Выбор того или иного варианта зависит от того, с какой силой (торком) встал имплантат в челюстную кость. </p>\n            <h3><strong>5. Установка постоянных протезов.</strong></h3>\n            <p>Постоянное протезирование обычно проводится после 2-6 месяцев после хирургического этапа имплантации зубов. За это время зубной имплант полностью сращивается с костной тканью, и происходит полное заживление десны. Временные протезы убираются, готовится финальный оттиск для постоянных протезов, и когда они будут готовы, врач-стоматолог фиксирует их на зубной имплантат.</p>\n            <p>Постоянные протезы могут быть изготовлены из различных материалов.\nУстановленные зубные имплантаты устойчивы к сильным нагрузкам, и практически ни в чем не уступают здоровым зубам человека. При классической имплантации зубов можно закрепить любые дентальные ортопедические конструкции: одиночный протез, мостовидный протез и даже полный условно-съемный протез.</p>\n        </div>\n\n    </section>'),
(73, 163, 'ru', '<h1 class=\"main_title\">Лечение зубов</h1>\n<p>Самые распространённые зубные заболевания - кариес, пульпит и периодонтит.</p><br>\n<p><strong>Кариес</strong> – это процесс постепенного разрушения тканей под воздействием внутренних и внешних факторов. В результате стенки зубов истончаются, образуется полость. По статистике, у 95% пациентов стоматологических клиник диагностируют кариес.</p><br>\n<p>Если кариесу вовремя не придать значения, болезнь прогрессирует и достигает зубного нерва – пульпы. Такой воспалительный процесс называется пульпитом. Игнорирование пульпита заканчивается удалением зуба. В стоматологии «M-Denta» в Краснодаре предлагают комплексное лечение пульпита. В него входят анестезия, удаление поражённых тканей, извлечение пульпы, пломбирование.</p><br>\n<p>Запущенные стадии кариеса и пульпита приводят к сложному и глубокому воспалительному процессу в корне зуба – периодонтиту. Поздно замеченный, он нередко заканчивается удалением зуба.</p>\n<p>Основные симптомы периодонтита:</p>\n<ul class=\"ul-not-styled\">\n<li>- нарастающая пульсирующая боль;</li>\n<li>- невозможность есть на больном зубе даже мягкую пищу;</li>\n<li>- повышенная температура, припухшая десна и половина губы со щекой.</li>\n</ul>\n<p>Своевременная диагностика и грамотный план лечения периодонтита повышают шансы на сохранение зуба.</p>\n\n'),
(79, 165, 'ru', ' <h1>Протезирование зубов</h1>\n \n        \n            <p>Если зуб не подлежит восстановлению, его удаляют. Когда таких зубов много, это не только портит внешний вид, но и вредит всему челюстно-лицевому аппарату. Так, увеличивается нагрузка на оставшиеся зубы, меняется прикус, зубы расходятся и выпадают.</p>\n            <p><strong>Для предотвращения этого необратимого процесса применяют протезирование зубов. </strong></p>\n        \n\n        \n            \n                <h2>Виды протезирования зубов</h2>\n                <p>Протезированием зубов занимается ортопедическая стоматология. Стоматолог-ортопед, работая в тандеме с терапевтом, хирургом и гнатологом, внимательно изучают состояние и строение челюсти и выбирают оптимальный вариант протезирования.</p>\n                <p>В зависимости от состояния зуба, стоматолог-ортопед выбирает один из следующих видов протезирования:</p>\n                <ul>\n                    <li>микропротезирование;</li>\n                    <li>протезирование;</li>\n                    <li>имплантология.</li>\n                </ul>\n            \n        \n\n        \n            <h3>Микропротезирование</h3>\n            <p>Оно применяется, когда есть незначительные повреждения коронки зуба или разрушающемуся зубу требуется защита. Микропротезирование эффективно, когда у зуба сохранился целым корень.</p>\n            <h3>Протезирование</h3>\n            <p>Подразумевает восстановление отсутствующих зубов с помощью установки штифтов и коронок. Представлено многообразием конструкций и материалов, из которых их изготавливают.</p>\n            <h3>Имплантология</h3>\n            <p>От двух первых отличается подходом. Протезирование подразумевает замену утерянных зубов на прикрепляемые разными способами вставные конструкции. Имплант же, в отличие от протеза, вживляется в костную ткань десны. </p>\n        \n\n         \n            <p>Технологически протезы разделяют на съёмные, несъёмные и условно-съёмные. </p>\n        \n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/prot-main-first.jpg\" alt=\"prtotezirovani\">\n            <div class=\"container-flex-2-info__text\">\n                <h4><strong>Съёмные протезы</strong></h4>\n                <p>Представляют собой конструкции, не предназначенные для постоянной носки.</p>\n                <p>Наиболее распространены пластиночные протезы. Они полностью заменяют утерянные зубы. Выглядят как съёмные челюсти, изготовленные из специального материала.</p>\n                <p>К этому же разделу относят съёмные бюгельные дентальные ортопедические конструкции. </p>\n            </div>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/prot-main-second.jpg\" alt=\"Установка съёмных протезов в Краснодаре\" title=\"Установка съёмных протезов в Краснодаре\">\n            <div class=\"container-flex-2-info__text\">\n                <h4><strong>Несъёмные протезы</strong></h4>\n                <p>Это механизмы, которые пациент носит постоянно несколько лет. Их либо прикрепляют к здоровым зубам, либо устанавливают автономно.</p>\n                <p>Такое протезирование применяют, когда большая часть зубов ещё сохранена.</p>\n                <p>К ним относят: коронки, виниры, люминиры и другие конструкции.</p>\n            </div>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/prot-main-third.jpg\" alt=\"Несъемные протезы в Краснодаре\" title=\"Несъемные протезы в Краснодаре\">\n            <div class=\"container-flex-2-info__text\">\n                <h4><strong>Условно-съёмные протезы</strong></h4>\n                <p>Такие протезы крепятся либо с помощью мостов (как в случае со съёмными конструкциями), либо с помощью вкручиваемых в полость десны шурупов. </p>\n                <p>В первом случае конструкция крепится к соседним зубам с помощью замка или на клей. При этом зубы не обтачивают. </p>\n                <p>Такие протезы снимает только стоматолог, поэтому они и называются условно-съёмными. </p>\n            </div>\n        </div>\n\n        <div class=\"wrapper-third\">\n            \n            	<h3>Цены на протезирование зубов в Красноадре</h3>\n                <p><strong>Цены на протезирование зубов зависят от многих факторов. Прочные, но дорогостоящие среди съёмных конструкций - бюгельные протезы. Ещё один ценообразующий фактор – материал, из которого сделаны протезы. </strong></p>\n                <p>Выбирая клинику для протезирования зубов в Краснодаре, смотрите на квалификацию стоматолога-ортодонта, возможность выбора материалов и техник для протезирования.</p>\n                <p><strong>Преимуществом авторской стоматологической клиники «M-Denta» является расположенная на её территории зуботехническая лаборатория, в которой зубной техник и стоматолог-ортопед, работая в команде, на каждом этапе контролируют изготовление зубных протезов любой сложности. </strong></p>\n            \n        </div>\n        '),
(81, 164, 'ru', '<section class=\"content\">\n		<div class=\"container-812\">\n			<a href=\"/protezirovanie-zubov\" class=\"nav-link\"><< Протезирование зубов</a>\n            <h1 class=\"black-centre-24\">Установка виниров IPS E.max в Краснодаре</h1>\n		</div>\n        \n        <div class=\"container-812\">       \n            <p>У нас можно заказать услугу — установка виниров, цена которой зависит от типа выбранных материалов.</p>\n            <p><strong>Перед установкой обязательно следует обязательно записаться на диагностику, чтобы выявить отсутствие противопоказаний и, при необходимости, пройти курс лечения.</strong></p>\n        </div>\n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">\n                Особенности установки и стоимость виниров в Краснодаре\n            </h2>\n            <p>Посещение врача перед установкой виниров позволит определить отсутствие брускизма, недостаточного объема зубной эмали, который требуется для крепления винира, кариеса с осложнениями, неправильного прикуса (глубокий или прямой прикус).</p>\n            <p>Специалисты нашей клиники смогут за минимальное количество времени поставить виниры (накладки на зубы), цена которых вас приятно удивит. Стоимость во многом зависит от выбора материала, из которого будут изготовлены пластины, их количества и сложностей работы специалистов по установке.</p>\n        </div>    \n        \n            <div class=\"container-flex-2\">\n                <img src=\"/img/new/vin-1.jpg\" alt=\"Установка виниров в Краснодаре\" title=\"Установка виниров в Краснодаре\">\n                <div class=\"container-flex-2-info__text\">\n                    <p><strong>У нас вы можете поставить керамические виниры на один зуб или несколько в зоне улыбки. Они изготавливаются из керамики e.max и отличаются своей прочностью.</strong></p>\n                    <h3>Виниры из керамики рекомендовано применять в следующих ситуациях:</h3>\n                    <ul>\n                        <li>Дефекты или потемнения эмали зубов.</li>\n                        <li>При изменении цвета зубной эмали после флюороза.</li>\n                        <li>При необходимости скрыть сколы на эмали.</li>\n                        <li>Когда нужно исправить форму зуба.</li>\n                    </ul>\n                    <p>В клинике «M-Denta» работают высококвалифицированные специалисты, знающие все особенности эстетической реставрации при помощи современных методов.</p>\n                </div>\n            </div>\n            \n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Виниры IPS e.max</h2>\n            <p>Виниры IPS.e.max, пожалуй, являются лидерами в сфере эстетической стоматологии и приобрели большую популярность во всём мире.</p>\n        </div>    \n            <div class=\"container\">\n                <div class=\"half-width\">\n                    <img src=\"/img/red-sun.png\" alt=\"red-sun\">\n                    <p>Вы можете не сомневаться в высоких показателях эстетичности благодаря большому спектру цветов и отличной светопроводимости;</p>\n                </div>\n                <div class=\"half-width\">\n                    <img src=\"/img/red-sandclock.png\" alt=\"sandclock\">\n                    <p>Керамика данной фирмы не теряет своих качеств и внешнего вида с течением времени;</p>\n                </div>\n                <div class=\"half-width\">\n                    <img src=\"/img/red-diamond.png\" alt=\"diamond\">\n                    <p>Виниры IPSe.max высокопрочны и биосовместимы;</p>\n                </div>\n                <div class=\"half-width\">\n                    <img src=\"/img/red-toothbrush.png\" alt=\"toothbrush\">\n                    <p>За данными винирами просто ухаживать, кроме того, они не накапливают зубной камень или налет;</p>\n                </div>\n                <div class=\"half-width\">\n                    <img src=\"/img/red-teeth.png\" alt=\"teeth\">\n                    <p>Нет необходимости сильно обтачивать зубы;</p>\n                </div>\n                <div class=\"half-width\">\n                    <img src=\"/img/red-bubble.png\" alt=\"bubble\">\n                    <p>Благодаря отсутствию металла такие конструкции очень легкие;</p>\n                </div>\n                <div class=\"half-width\">\n                    <img src=\"/img/red-shield.png\" alt=\"shield\">\n                    <p>Не вызывают аллергической реакции.</p>\n                </div>\n            </div>\n        <div class=\"container-812\">\n            <h3 class=\"red-centre-bold\">Кому подойдут виниры IPS e.max</h3>\n            <div class=\"container-flex-2\">\n                <img src=\"/img/new/vin-2.jpg\" alt=\"Виниры IPS e.max в Краснодаре\" title=\"Виниры IPS e.max в Краснодаре\">\n                <div class=\"container-flex-2-info__text\">\n                    <p>Виниры устанавливают по желанию пациента при наличии неэстетичных пятен на эмали, при её дефектах, при наличии щелей между зубами, если формы зубов были изменены.</p>\n                    <br>\n                    <p>Примечательно, что виниры могут быть установлены как с препаровкой зубов, так и без неё, если такая возможность имеется. Обтачиваются зубы только спереди. При установке виниров IPS e.max эмаль шлифуется минимально, до 0,6 мм.</p>\n                    <p>Зуб после установки винира выглядит эстетично и естественно.</p>\n                </div>\n            </div>\n        </div>\n    </section>'),
(83, 166, 'ru', '    <section class=\"protezirovanie-metall\">\n        \n        <div class=\"container-812\">\n            <a href=\"/protezirovanie-zubov\" class=\"nav-link\"> << Протезирование зубов </a>\n            <h1 class=\'black-centre-24\'>Металлокерамические коронки в Краснодаре</h1>\n        </div>  \n        <div class=\"container-812\">\n            <p>Металлокерамика – популярный материал для зубного протезирования. Из-за своей прочности, надёжности и внешнего вида металлокерамические коронки отвечают как эстетическим, так и практическим требованиям.</p>\n            <p>Металлокерамические коронки в Краснодаре успешно устанавливают врачи авторской стоматологической клиники «M-Denta» с 1997 года. </p>\n            <h2 class=\"red-centre-bold\">Устройство коронок и их виды</h2>\n            <p>Металлокерамика сочетает в себе свойства металла и эстетическую привлекательность керамики. Благодаря первым, коронки отличает высокая прочность и устойчивость к действиям окружающей среды. Цвет и текстура керамики придают привлекательный внешний вид и с лёгкостью имитируют настоящий зуб.</p>\n            <p>Металлокерамическая коронка состоит из металлического каркаса и покрытия. В основе каркаса – металл или его медицинские сплавы. Толщина – до 0,5 мм. Сверху коронку покрывают слоем керамики, который наносят по индивидуально изготовленным гипсовым слепкам.</p>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/new/metall-1.jpg\" alt=\"Металлокерамические коронки в Кранодаре\" title=\"Металлокерамические коронки в Кранодаре\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Каркас металлокерамической коронки – сплав металла – изготавливают из:</p>\n                <ul>\n                    <li>Соединений элитных металлов: золото, платина, титан, палладий. Коронки, которые изготовлены из них, отличаются высокой надёжностью и прочностью, натуральным цветом. Они подходят для протезирования передних зубов.</li>\n                    <li>Никель-хромовые и кобальт-хромовые сплавы, специально разработанные для стоматологических целей.</li>\n                </ul>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Показания и противопоказания к установке металлокерамических коронок</h2>\n            <p>Металлокерамические коронки устанавливают, когда:</p>\n            <ul>\n                <li>присутствуют видимые дефекты;</li>\n                <li>разрушения зуба приобрели необратимый характер;</li>\n                <li>коронку ставят на имплант;</li>\n                <li>устанавливают протезы на штифтах;</li>\n                <li>нет одного или нескольких зубов;</li>\n                <li>зубы служат опорными элементами;</li>\n                <li>кариес затронул участок, находящийся ниже уровня десны.</li>\n            </ul>\n            <p>Коронки не устанавливают при психических заболеваниях, хроническом пародонтите, нарушении прикуса, синдроме скрежета зубами и беременности. Протезирование перенесут при воспалениях в полости рта и ослабления организма после перенесённой болезни.</p>\n            <p>Стоматологи авторской клиники «M-Denta» в каждом конкретном случае проведут детальный осмотр и предложат экспертный выход из сложной или нестандартной стоматологической ситуации.</p>\n        </div>\n\n        <div class=\"wrapper-first\"></div>\n\n        <div class=\"container-812\">\n            <h3>Основной плюс металлокерамических коронок – надёжная защита зуба. Вот другие преимущества:</h3>\n        </div>\n\n        <div class=\"container-flex-pl13\">\n            <img src=\"/img/prot-red-puzzle.png\" alt=\"protezirovanie\">\n            <div class=\"container-flex-pl13-info__text\">\n                <p>Полная совместимость с дёснами и ротовой полостью. Разработанный с учётом индивидуальных особенностей протез не вызывает дискомфорта и отторжения организмом.</p>\n            </div>\n        </div>\n\n        <div class=\"container-flex-pl13\">\n            <img src=\"/img/prot-red-apple.png\" alt=\"protezirovanie\">\n            <div class=\"container-flex-pl13-info__text\">\n                <p>Практичность. Металлокерамика – материал, который воссоздаёт не только анатомические особенности зуба, но и его функционал. Установленные коронки возвращают возможность жевать пищу, говорить.</p>\n            </div>\n        </div>\n\n        <div class=\"container-flex-pl13\">\n            <img src=\"/img/prot-red-brush.png\" alt=\"protezirovanie\">\n            <div class=\"container-flex-pl13-info__text\">\n                <p>Уход за протезом простой. Организм, как правило, быстро подстраивается под изменения во рту. </p>\n            </div>\n        </div>\n\n        <div class=\"container-flex-pl13\">\n            <img src=\"/img/prot-red-teeth.png\" alt=\"protezirovanie\">\n            <div class=\"container-flex-pl13-info__text\">\n                <p>Внешний вид. Форма коронки, цвет и структурные характеристики полностью соответствуют естественным.</p>\n            </div>\n        </div>\n\n        <div class=\"container-flex-pl13\">\n            <img src=\"/img/prot-red-diamond.png\" alt=\"protezirovanie\">\n            <div class=\"container-flex-pl13-info__text\">\n                <p>Износостойкость, долговечность и гигиеничность. Металлокерамические коронки не поддаются воздействию микроорганизмов, обитающих в ротовой полости. Они не изменяют цвет, не крошатся и не трескаются. При соблюдении рекомендаций срок службы – до семнадцати лет.</p>\n            </div>\n        </div>\n\n         <div class=\"container-flex-2\">\n            <img src=\"/img/new/metall-2.jpg\" alt=\"Металлокерамические коронки в Кранодаре\" title=\"Металлокерамические коронки в Кранодаре\">\n            <div class=\"container-flex-2-info__text\">\n                <h3><strong>Недостатки металлокерамических коронок</strong></h3>\n                <p>Самый очевидный минус – чтобы установить протез, стачивают до 2 мм зубной эмали. Из-за такой процедуры возникает большая вероятность ожога зубного нерва. В итоге приходится снимать коронку и всё переделывать. Зубной нерв удаляют, а сам зуб становится хрупким.</p>\n                <p>У некоторых людей присутствует аллергическая реакция даже на такие металлы, как золото и платина.</p>\n                <p>Кроме того, металлокерамические конструкции подвержены сколам, их нельзя профессионально отбеливать. Поэтому такие коронки редко устанавливают на передние зубы.</p>\n            </div>\n        </div>\n        	\n    	<div class=\"wrapper-second\">\n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Как ухаживать за металлокерамическими коронками</h2>\n            <p>Стоматологи и зубные техники авторской стоматологической клиники «M-Denta» рекомендуют тщательно ухаживать за протезами. <strong> Вот как это делать:</strong></p>\n            <ul>\n                <li>Менять зубную щётку раз в 2-3 месяца.</li>\n                <li>Каждый раз после еды чистить зубы круговыми и метущими движениями от основания зуба к его краю.</li>\n                <li>Не пользоваться пастой с мелкозернистым составом.</li>\n                <li>Жевать и грызть с осторожностью, чтобы предотвратить риск появления трещин и сколов.</li>\n                <li>Межзубное пространство прочищать флоссом и специальным ёршиком.</li>\n                <li>Несколько раз в неделю промывать зубы с помощью ирригатора на травяном или дезинфицирующем растворе.</li>\n                <li>Обязательно сделать рентген перед окончанием гарантийного срока металлокерамической коронки, а также не забывать регулярно посещать стоматолога. </li>\n            </ul>\n        </div>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/prot-metall-second.jpg\" alt=\"Установка металлокерамических коронок\" title=\"Установка металлокерамических коронок\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Правила по уходу просты. Если следовать им, то протез прослужит максимально долго. </p>\n                <p><strong>При выборе врача для установки металлокерамической коронки уделите внимание факту наличия собственной зуботехнической лаборатории на базе клиники.</strong></p>\n                <p>В «M-Denta» стоматолог-ортопед и зубной техник работают слаженно. Первый квалифицированно выполняет весь спектр работ по подготовке зуба к установке протеза, второй – в лаборатории, оснащённой передовым оборудованием, изготавливает высокотехнологичную металлокерамическую коронку.</p>\n                <p>Цена на установку зависит от сложности клинического случая.</p>\n            </div>\n        </div>\n        \n    </section>');
INSERT INTO `db__str_filling` (`id`, `pid`, `locale`, `content`) VALUES
(85, 167, 'ru', '    <section class=\"protezirovanie-oksid\">\n\n       <div class=\"container-812\">\n           <a href=\"/protezirovanie-zubov\" class=\"nav-link\"> << Протезирование зубов</a>\n           <h1 class=\"black-centre-24\">Оксид-циркониевые коронки. Установка в Краснодаре</h1>\n           <p>Врачи авторской стоматологической клиники «M-Denta» уже давно и успешно занимаются протезированием зубов. В арсенале клиники: высококвалифицированные стоматологи, зубной техник и собственная зуботехническая лаборатория. </p>\n           <p>Помимо металлокерамических, устанавливают оксид-циркониевые коронки. Цирконий доказал свою прочность, отсутствие аллергических реакций и высокую эстетичность при применении в стоматологических целях.</p>\n       </div>\n\n		<div class=\"container-flex-2\">\n            <img src=\"/img/new/oksid-1.jpg\" alt=\"Устанвка оксид цирокниевых коронок в Краснодаре\" title=\"Устанвка оксид цирокниевых коронок в Краснодаре\">\n            <div class=\"container-flex-2-info__text\">\n                <h3 class=\"red-centre-bold\" style=\"text-align: left; margin-top: 0;\">Показания к установке циркониевых коронок</h3>\n                <p>Они представляют собой металлический каркас, на который сверху наносится слой специальной эмали. Оксид-циркониевые коронки устанавливают в следующих случаях:</p>\n                <ul>\n                    <li>у пациента обнаружен сахарный диабет или заболевания эндокринной системы;</li>\n                    <li>очень заметные нарушения зубного ряда: полностью отсутствуют передние или боковые жевательные зубы;</li>\n                    <li>зубы местами сколоты, нарушены твёрдые ткани;</li>\n                    <li>собственный цвет эмали зубов потемнел;</li>\n                    <li>в протезировании нуждаются более 4 зубов;</li>\n                    <li>у протезируемых зубов здоровые нервы. Все другие виды коронок предполагают удаление нерва, циркониевые же устанавливают без него.</li>\n                </ul>\n            </div>\n        </div>\n\n		<div class=\"wrapper\">\n            <div class=\"container-812\">\n                <p>Отличительная особенность циркониевых коронок, помимо высокой прочности, - способность имитировать натуральный цвет и блеск зуба. Он, в отличие от металлокерамики, высокочувствителен к свету, пропускает его через себя.</p>\n                <p>Качество оксид-циркониевых коронок не вызывает сомнения ни у одного стоматолога или счастливого пациента. Однако у циркониевых протезов есть как минусы, так и плюсы.</p>    \n            </div>\n        </div>\n        \n        <h2 class=\"red-centre-bold\">Преимущества оксид-циркониевых коронок</h2>\n         \n        <div class=\"container-812\">\n            <div class=\"half-width\">\n                <img src=\"/img/prot-red-shield.png\" alt=\"protezirovanie\">\n                <p>Гипоаллергенность. Цирконий – металл, который не вызывает аллергических реакций и хорошо переносится пациентами. </p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/prot-red-loop.png\" alt=\"protezirovanie\">\n                <p>Протезы пропускают свет и точно передают цвет эмали. Такой способностью обладают, кроме циркониевых, только натуральные зубы.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/prot-red-moon.png\" alt=\"protezirovanie\">\n                <p>Верхнее покрытие коронки – эмаль – не тускнеет и не меняет цвет и блеск со временем.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/prot-red-diamond.png\" alt=\"protezirovanie\">\n                <p>Минимальный срок службы – 15 лет. Коронки прочны и надёжны.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/prot-red-notebook.png\" alt=\"protezirovanie\">\n                <p>Исключен дискомфорт при примерке и носке, потому что коронки создаются не вручную, а с помощью компьютера.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/prot-red-clean.png\" alt=\"protezirovanie\">\n                <p>Зубы для установки протеза не обтачивают до неузнаваемости.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/prot-red-heart.png\" alt=\"protezirovanie\">\n                <p>Цирконий – безопасный материал и для ротовой полости, и для остального организма.</p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Недостатки</h2>\n            <p>Единственный минус циркониевых коронок – высокая цена на их установку. В стоимость замены одного зуба входит его подготовка, технологический процесс создания коронки (от моделирования на компьютере до обжига в печи), временная пластмассовая конструкция и цена самого циркония.</p>\n        </div>\n    \n        <div class=\"wrapper-second\"></div>\n\n        <div class=\"container-812\">\n            <h3 class=\"red-centre-bold\">Противопоказания к установке коронок из оксида циркония</h3>\n            <p>Даже такие высокотехнологичные и безопасные протезы запрещено устанавливать:</p>\n            <ul>\n                <li>беременным;</li>\n                <li>людям с психическими отклонениями;</li>\n                <li>с нарушением прикуса;</li>\n                <li>после перенесённого инфекционного заболевания;</li>\n                <li>с воспалениями во рту.</li>\n            </ul>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/new/oksid-2.jpg\" alt=\"Устанвка оксид цирокниевых коронок в Краснодаре\" title=\"Устанвка оксид цирокниевых коронок в Краснодаре\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Установка оксид-циркониевых коронок в авторской стоматологической клиники «M-Denta» в Краснодаре проходит в несколько этапов:</p>\n                <p>1. Сначала стоматолог-ортопед осматривает зуб, подготавливает слепок будущего протеза.</p>\n                <p>2. Зубной техник на компьютере создаёт модель коронки.</p>\n                <p>3. Вытачивает каркас с помощью специального станка, обжигает для дополнительной прочности.</p>\n                <p>4. Наносит на каркас фарфор в несколько слоёв, чтобы цвет стал максимально естественным.</p>\n                <p>5. Пациенту примеряют готовую коронку. Если сидит идеально – фиксируют.</p>\n            </div>\n        </div>\n\n    </section>'),
(86, 168, 'ru', '<section class=\"protezirovanie-ips\">\n        \n        <div class=\"container-812\">\n            <a href=\"/protezirovanie-zubov\" class=\"nav-link\"> << Протезирование зубов</a>\n            <p class=\"black-centre-24\">Коронки IPS E.max</p>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/new/kor-1.jpg\" alt=\"protezirovanie\">\n            <div class=\"container-flex-2-info__text\">\n            	<p>Протезирование — достаточно распространенная услуга, но тем не менее это не означает, что вы гарантированно получите хороший результат при обращении в любую стоматологическую клинику. </p>\n            	<p><strong>Долговечность, качество, безопасность и надежность — вот основные принципы, которыми руководствуются специалисты стоматологической клиники «M-Denta».</strong></p>\n                <p>У нас вы можете установить керамику IPS e.max, изготовление которой осуществляется без применения металла. Это одно из современных достижений в сфере эстетической стоматологии.</p>\n                <p>Высокая прочность системы достигается благодаря используемой технологии прессования керамики и содержания в ней кристаллов лейцита.</p>\n                <p><strong>IPS e.max успешно применяется стоматологами нашей клиники, т.к. она позволяет полностью воссоздать форму разрушенных зубов и их цвет. Методом прессования IPS e.max изготавливаются не только коронки, но также виниры.</strong></p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <p>Коронки IPS e.max получили особую популярность благодаря своим особенностям:</p>\n            <div class=\"half-width\">\n                <img src=\"/img/red-sun.png\" alt=\"protezirovanie\">\n                <p>Высокая эстетика, светопроводимость, естественная глубина света.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-sandclock.png\" alt=\"protezirovanie\">\n                <p>Долговечность эксплуатации.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-diamond.png\" alt=\"protezirovanie\">\n                <p>Высокая прочность и биосовместимость.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-teeth.png\" alt=\"protezirovanie\">\n                <p>Нет необходимости сильно обтачивать зубы.</p>\n            </div>\n        </div>\n\n    </section>'),
(89, 169, 'ru', ' <section class=\"protezirovanie-bugel\">\n        \n        <div class=\"container-812\">\n            <a href=\"/protezirovanie-zubov\" class=\"nav-link\"> << Протезирование зубов</a>\n            <h1 class=\"black-centre-24\">Бюгельные протезы в Краснодаре</h1>\n        </div>\n\n        <div class=\"container-flex-2\">       \n            <div class=\"container-flex-2-info__text\">\n                <p>Бюгельные протезы – дентальные ортопедические конструкции, которые устанавливают для восстановления функций челюстей, если в зубном ряду не хватает одного или нескольких зубов. </p>\n                <p>Бюгельные протезы представляют собой съёмную дентальную акриловую конструкцию на металлической дуге, на концах которой находятся крепления. </p>\n                <p>Дуга изготовлена из сверхпрочного сплава, который не ржавеет и не окисляется в ротовой полости. Форма дуги выбрана неслучайно: в отличие от линейных конструкций, она выдерживает большие нагрузки и равномерно распределяет их между зубами и слизистой. </p>\n            </div>\n            <img src=\"/img/red-bugel-first.png\" alt=\"protezirovanie\">\n        </div>\n\n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Преимущества бюгельных протезов</h2>\n            <p>Бюгельные протезы отличает плотность прилегания к челюсти и нёбу, долговечность, прочность. Их применяют при выраженных дефектах зубного ряда на верхней и нижней челюсти. Вот преимущества бюгельных протезов зубов:</p>\n            <div class=\"half-width\">\n                <img src=\"/img/red-24.png\" alt=\"protezirovanie\">\n                <p>Наличие конструкций, предназначенных для круглосуточной носки. </p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-toothbrush.png\" alt=\"protezirovanie\">\n                <p>Ухаживать за ними довольно просто: зубная щётка, специальные ёршики и ирригатор – минимальный, но действенный набор для ежедневной гигиены.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-leaf.png\" alt=\"protezirovanie\">\n                <p>Снижено воздействие на костную ткань и слизистые.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/impl-red-face.png\" alt=\"protezirovanie\">\n                <p>Тонкая металлическая пластина, соединяющая элементы бюгельной конструкции, не нарушает речь и жевательную функцию.</p>\n            </div>\n             <div class=\"half-width\">\n                <img src=\"/img/red-like.png\" alt=\"protezirovanie\">\n                <p>По сравнению с пластмассовой, такая конструкция тоньше и удобнее для носки. </p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Противопоказания к установке</h2>\n            <p>Стоматологи авторской клиники «M-Denta» откажут в установке бюгельного протеза, если:</p>\n            <ul>\n                <li>во рту начался воспалительный процесс;</li>\n                <li>пациент имеет заболевания дыхательной системы, сосудов или сердца, онкологические болезни или сахарный диабет;</li>\n                <li>нельзя зафиксировать протез на опорные зубы;</li>\n                <li>у пациента индивидуальная непереносимость протезных конструкций.</li>\n            </ul>\n            <h3 class=\"red-centre-bold\">Виды крепления бюгельных протезов</h3>\n        </div>\n\n        <div class=\"container-flex-2\">     \n            <img src=\"/img/red-bugel-second.png\" alt=\"protezirovanie\">  \n            <div class=\"container-flex-2-info__text\">\n                <p>Съёмные протезы крепятся к опорным зубам с помощью:</p>\n                <ul>\n                    <li>кламеров;</li>\n                    <li>телескопических коронок;</li>\n                </ul>\n                <p>Кламеры – специальные металлические крючки, с помощью которых бюгели прикрепляются к опорным зубам. Они удобны, просты в носке.</p>\n                <p>Пациенты быстро к ним адаптируются. Их явный недостаток – заметность: металлические крепления хорошо видны. </p>\n            </div> \n        </div>\n\n        <div class=\"container-812\">\n            <p>Бюгельные протезы с телескопической фиксацией надевают либо на зубы, либо на специально устанавливаемые импланты. Они надёжны и прочны, недостаток заключается в сложности изготовления и вытекающей из этого высокой цене. </p>\n            <h3 class=\"red-centre-bold\">Уход за бюгельными протезами</h3>\n            <p>Во время носки протеза гигиена ротовой полости особенно важна. Стоматологи авторской клиники «M-Denta» рекомендуют:</p>\n            <ul>\n                <li>ополаскивать рот водой после еды;</li>\n                <li>очищать протез зубной щёткой с пастой дважды в день;</li>\n                <li>не чистить вставную конструкцию пастами с крупными очищающими частицами;</li>\n                <li>съёмный протез обрабатывает в специальном растворе в течение 5-10 мин.;</li>\n                <li>перед тем, как надеть протез, необходимо тщательно очистить зубы, межзубное пространство и места, где зубы соприкасаются с десной, флоссом или специальным стоматологическим ёршиком;</li>\n            </ul>\n            <p>Цена на бюгельные протезы зависит от конкретного клинического случая и сложности изготовления протеза. </p>\n        </div>\n\n    </section>'),
(93, 170, 'ru', '<section class=\"protezirovanie-full\">\n        \n        <div class=\"container-812\">\n            <a href=\"/protezirovanie-zubov\" class=\"nav-link\"> << Протезирование зубов</a>\n            <p class=\"black-centre-24\">Полные съемные протезы</p>\n        </div>\n\n        <div class=\"container-flex-2\">       \n            <div class=\"container-flex-2-info__text\">\n                <p>У потери зубов разные причины: возрастные изменения челюсти, физическое воздействие, вовремя не вылеченный кариес. Отсутствие зубов во рту выглядит неэстетично, затрудняет жевание и способность внятно говорить.</p>\n                <p>В таком случае на помощь приходят дентальные конструкции, имитирующие зубы и челюсти. <strong>Стоматологи авторской стоматологической клиники «M-Denta» с 1997 года успешно устанавливают полные съёмные зубные протезы.</strong></p>\n                <p>Съёмные зубные протезы – вставные конструкции, которые восстанавливают целостность зубного ряда. Отличительная особенность по сравнению с другими протезами – пациент легко сам их вставляет и извлекает.  </p>\n            </div>\n            <img src=\"/img/prot-full.png\" alt=\"protezirovanie\">\n        </div>\n\n        <div class=\"container-812\">\n            <p class=\"red-centre-bold\">Виды съёмных протезов</p>\n            <p>Съёмные протезы делятся на: </p>\n            <ul>\n                <li>бюгельные;</li>\n                <li>пластинчатые.</li>\n            </ul>\n            <p class=\"red-centre-bold\">Бюгельные съёмные протезы</p>\n            <p>Это вставные зубы на металлической дуге. Такие протезы фиксируют как при частичной, так и при полной адентии. Края дуги прикрепляются к дёснам с помощью специальных фиксаторов. Бюгели при полной потере зубов не очень популярны. Их в основном используют для частичного восстановления. </p>\n            <p class=\"red-centre-bold\">Пластинчатые съёмные протезы</p>\n            <p>Это изготавливаемая на заказ с учётом индивидуального строения зубов и дёсен вставная дентальная конструкция. Она надёжно закрепляется во рту и полноценно выполняет функции зубов даже при полной их потере. Такие протезы изготавливают из:</p>\n            <ul>\n                <li>Акрила. Акриловые протезы надёжны, легки и долговечны. Цвет зубов и дёсен подбирают максимально приближенно к естественному. Единственный недостаток – возможные аллергические реакции. </li>\n                <li>Нейлона. Нейлоновые съёмные зубные протезы стоят дороже, поскольку этот материал более мягкий и гибкий. Привыкание проходит быстрее. В отличие от акриловых, такие зубные протезы не вызывают аллергии.  Однако нейлон – материал хрупкий. Поэтому ухаживать за ним нужно осторожно, чтобы избежать появления царапин и разломов. </li>\n            </ul>\n        </div>\n\n        <div class=\"wrapper-first\"></div>\n\n        <div class=\"container-812\">\n            <p class=\"red-centre-bold\">Как ухаживать за протезом</p>\n            <p>В стоматологической клинике «M-Denta» рекомендуют тщательно ухаживать за съёмным протезом:</p>\n            <ul>\n                <li>Чистить протез специальной или очень мягкой зубной щёткой с фторсодержащей пастой. Лучше заранее подстелить под протез мягкое полотенце или набрать в раковину воды, чтобы в процессе чистки случайно не уронить и не разбить конструкцию.</li>\n                <li>После еды всегда снимать протез и промывать его под проточной водой;</li>\n                <li>Ежедневно дезинфицировать протез в специальном растворе. Через 15 мин дезинфекции конструкцию ополаскивают в отстоянной воде.</li>\n                <li>Один раз в полгода отдавать в стоматологию для профессиональной ультразвуковой очистки.</li>\n                <li>Поддерживать в чистоте не только протез, но и ротовую полость. Чистить зубы, язык и нёбо. Если зубов не осталось – протирать рот марлевым тампоном.</li>\n                <li>Хранить протез в специальном контейнере или в хлопчатобумажной ткани.</li>\n            </ul>\n            <p>Чтобы протез не ломался и функционировал долго, важно соблюдать все рекомендации стоматолога-ортопеда.</p>\n            <p><strong>В авторской стоматологической клинике «M-Denta» изготавливают съёмные протезы по высокотехнологичной системе IVOCAP. По этой методике зубной протез не «варится», как обычно, а прессуется. Такая обработка исключает усадку конструкции, что гарантирует быстрое привыкание. </strong></p>\n            <p>Цену на съёмные протезы формируют сложность конструкции и материал протеза.</p>\n        </div>\n\n    </section>'),
(96, 171, 'ru', '<section class=\"hirurgicheskaya-stomatologiya\">\n        \n        <div class=\"container-812\">\n            <h1 class=\"black-centre-24\">Удаление зуба. Хирургическая стоматология.</h1>\n        </div>\n\n        <div class=\"container-flex-2\">       \n            <img src=\"/img/hirurg-first.jpg\" alt=\"hirurgicheskaya-stomatologiya\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Одно из наиболее общепринятых мнений заключается в том, что врачи, которые специализируются в хирургической стоматологии, занимаются исключительно удалением зуба. На самом деле, это не совсем так. Если действительно нет возможности спасти зуб, специалист однозначно примет решение об удалении. Процедура проводится безболезненно, поэтому опасаться болевых ощущений не стоит.</p>\n                <p><strong>В авторской стоматологической клинике «M-Denta» используются исключительно современные технологии и новейшее оборудование. Врачи клиники применяют эффективные анестезиологические препараты, при помощи которых удаление зуба проходит абсолютно безболезненно.</strong></p>\n            </div>\n        </div>\n        \n        <div class=\"container-812\">\n            <p>Цены удаления зубов в Краснодаре представлены в нашем <a class=\"link\" href=\"/ceny\">прайс-листе.</a> Мы предлагаем разумную ценовую политику и высококачественный сервис.</p>\n            <h2 class=\"red-centre-bold\">Удаление зуба - еще не все потеряно</h2>\n            <p>При посещении стоматологов, вам не придется подолгу сидеть в кресле. Наиболее сложные операции занимают минимум времени. После удаления зубов вам будет предложен выбор — проведение имплантации или установка протеза.</p>\n            <p>Несмотря на то, что стоимость имплантации зубов гораздо превышает протезирование без имплантатов, в настоящее время гораздо большей популярностью пользуются именно имплантаты.</p>\n            <p><strong>Основное преимущество имплантатов заключается в том, что искусственный зуб сможет прослужить гораздо дольше, чем установленный протез и обеспечит полноценную замену натурального.</strong></p>\n            <p>К преимуществам имплантации зубов относится:</p>\n        </div>\n\n        <div class=\"container-812\">\n            <div class=\"half-width\">\n                <img src=\"/img/red-diamond.png\" alt=\"hirurgicheskaya-stomatologiya\">\n                <p>Высокая эстетичность (зубной ряд выглядит естественно).</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-starwand.png\" alt=\"hirurgicheskaya-stomatologiya\">\n                <p>Имплантация позволяет решить абсолютно любые проблемы и восстановить необходимое количество зубов.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/prot-red-teeth.png\" alt=\"hirurgicheskaya-stomatologiya\">\n                <p>Безопасность для соседних зубов. Даже при восстановлении одного зуба при помощи имплантации не требуется проведение обточки соседних, что свойственно при фиксации мостовидных протезов.</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-gears.png\" alt=\"hirurgicheskaya-stomatologiya\">\n                <p>Имплантаты способствуют восстановлению костной ткани. Они фактически «заставляют» ее работать за счет нагрузки, которая передается кости при употреблении пищи.</p>\n            </div>\n        </div>\n\n        <div class=\"container-flex-2\">       \n            <img src=\"/img/hirurg-second.jpg\" alt=\"hirurgicheskaya-stomatologiya\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Зубные имплантаты — это отличная альтернатива любым другим методам протезирования. Они не натирают десны, не расшатываются и способны прослужить не один десяток лет.</p>\n                <p>К тому же имплантаты не вызывают дефектов речи и не изменяют вкус потребляемой пищи. Под такими протезами не происходит развитие кариеса, а ухаживать за ними следует также, как и за натуральными зубами, без каких-либо дополнительных процедур.</p>\n                <p><strong>Специалисты клиники «M-Denta» стараются до последнего сохранить зубы пациентов. Если существует хотя бы один шанс сохранить зуб, мы обязательно его используем и не прибегнем к процедуре удаления.</strong></p>\n            </div>\n        </div>\n        \n        <div class=\"container-812\">\n            <p>При необходимости провести удаление, врач в обязательном порядке сделает снимок. Цена удаления зуба в Краснодаре зависит от типа удаления. Выделяют простое и сложное, а также удаление ретинированного, полуретинированного зуба, молочного зуба, зуба мудрости.</p>\n            <p>У нас работает команда профессионалов и имеется все необходимое оборудование для оказания хирургической помощи, которую можно выполнять при амбулаторном лечении.</p>\n        </div>\n        \n    </section>'),
(97, 172, 'ru', '<section class=\"ortodontiya\">\n        \n        <div class=\"container-812\">\n            <h1 class=\"black-centre-24\">Исправление прикуса в Краснодаре</h1>\n            <p><strong>Современные методы исправления прикуса – это не только брекеты. С развитием технологий системы выравнивания зубов становятся всё более незаметными и эффективными, позволяя сокращать сроки стоматологического лечения.</strong></p>\n        </div>    \n        <!--    <p class=\"red-centre-bold\">Invisalign (Инвизилайн)</p>\n            <p>Invisalign – съёмные ортодонтические дентальные конструкции для коррекции прикуса. От привычных брекетов их отличает:</p>\n        </div>\n\n        <div class=\"container-812\">\n            <div class=\"half-width\">\n                <img src=\"/img/red-diamond.png\" alt=\"ortodontiya\">\n                <p>полная прозрачность;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-onoff.png\" alt=\"ortodontiya\">\n                <p>возможность самостоятельно снимать и надевать обратно;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-bubble.png\" alt=\"ortodontiya\">\n                <p>уменьшенное давление на зубы;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/lech-apple-red.png\" alt=\"ortodontiya\">\n                <p>отсутствие ограничений в еде;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-highlight.png\" alt=\"ortodontiya\">\n                <p>плотное прилегание к зубам;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-leaf.png\" alt=\"ortodontiya\">\n                <p>безвредность для эмали;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-no.png\" alt=\"ortodontiya\">\n                <p>отсутствие риска развития кариеса.</p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <p>Съёмные элайнеры Инвизилайн – инновационная разработка американской корпорации Align Technology. Конструкция изготовлена из прочного термопластичного прозрачного материала медицинского класса, который не вызывает аллергии, не деформируется и не меняет цвет при носке.</p>\n            <p>На сегодняшний день по всему миру 5 000 000 пациентов исправили свой прикус с использованием данного метода. Вот причины такой популярности:</p>\n        </div>\n\n        <div class=\"wrapper-first\">\n            <div class=\"container-812\">\n                <p>1. полностью автоматизированный процесс разработки модели элайнера. Разработанная производителем компьютерная программа показывает поэтапно результат выравнивания зубов с помощью Инвизилайн. Пациент видит, когда, как и какие элементы зубного ряда примут нужное положение.</p>\n                <p>2. возможность проводить лечение только сертифицированным стоматологам. По всему миру 90000 стоматологов-ортодонтов имеют сертификат, позволяющий им применять Инвизилайн.</p>\n                <p>3. эти капы изготавливают в лаборатории производителя индивидуально для каждого пациента. После тщательной диагностики и компьютерного моделирования желаемого результата стоматолог отсылает слепок и все необходимые расчёты в США, откуда позже приходит созданный для каждого клинического случая комплект элайнеров. Каждому пациенту присваивается номер в системе на сайте производителя, что позволяет следить за ходом выполнения заказа.</p>\n            </div>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/ort-first.png\" alt=\"ortodontiya\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Механизм выравнивания следующий: при первой фиксации капа принимает форму зуба, а затем начинает медленно возвращаться в исходное положение, подтягивая за собой соответствующий элемент зубного ряда.</p>\n                <p>Инвизилайн применяют по показаниям стоматолога-ортодонта. Они доказали эффективность при:</p>\n                <ul>\n                    <li>щели между зубами;</li>\n                    <li>скученности зубов;</li>\n                    <li>различных формах нарушения окклюзии.</li>\n                </ul>\n                <p>Однако Инвизилайн применяется только при сформировавшемся прикусе, так что его ставят взрослым и подросткам с 14-15 лет.</p>\n            </div>\n        </div>\n\n        <div class=\"wrapper-second\">\n            <div class=\"container-812\">\n                <p class=\"red-centre-bold\">Этапы выравнивания зубов с Invisalign</p>\n                <p>1. На первой консультации проводится полная диагностика, санация полости рта и профессиональная чистка.</p>\n                <p>2. С челюстей пациента делаются слепки, по ним изготавливаются точные анатомические модели. В сертифицированной программе Clean Check создается план лечения и 3D-модель. Компьютерное моделирование позволяет сразу увидеть, как, куда и когда переместятся зубы.</p>\n                <p>3. Полученные данные отправляется в лабораторию Align Technology в США, где индивидуально для каждого пациента изготавливают комплект элайнеров.</p>\n                <p>4. Через некоторые время стоматолог-ортодонт получает капы и назначает приём, во время которого учит пациента самостоятельно снимать и надевать капы, ухаживать за ними и менять по графику.</p>\n                <p>5. Лечение прикуса на Invisalign занимает от 0,5 до 2-х лет. Капы меняются раз 2-3 недели, а к стоматологу на приём нужно приходить не чаще, чем раз в 6-8 недель. Для достижения результата Инвизилайн нельзя снимать больше, чем на 2-4 часа в сутки. Этого времени вполне достаточно, чтобы поесть, почистить зубы и вымыть капы в специальном растворе, который поставляется в комплекте.</p>\n                <p>6. После завершения лечения капами необходимо в течение некоторого времени носить ретейнеры, чтобы предотвратить естественное обратное смещение.</p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <p>Уход за элайнером и правила носки:</p>\n        </div>\n\n        <div class=\"container-812\">\n            <div class=\"half-width\">\n                <img src=\"/img/red-sandclock.png\" alt=\"ortodontiya\">\n                <p>инвизалайн необходимо носить 22-23 часа в сутки;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-toothbrush.png\" alt=\"ortodontiya\">\n                <p>тщательно чистить зубы после еды перед фиксацией кап;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-breakfast.png\" alt=\"ortodontiya\">\n                <p>обязательно снимать элайнер во время еды;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/impl-red-drop.png\" alt=\"ortodontiya\">\n                <p>сам элайнер промывать в специальном растворе несколько раз в неделю;</p>\n            </div>\n            <div class=\"half-width\">\n                <img src=\"/img/red-gum.png\" alt=\"ortodontiya\">\n                <p>не жевать жвачку с капами во рту.</p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <p>Несмотря на очевидные достоинства, у Инвизалайн есть один минус – высокая цена. Однако она вполне оправдана, если учесть, что каждая капа изготавливается индивидуально в США по результатам диагностики сертифицированного стоматолога-ортодонта.</p>\n            <p>Здоровая улыбка за короткий срок с минимальными неудобствами – вот что даёт пациентам авторской стоматологической клиники «M-Denta» Инвизалайн.</p>\n        </div>\n\n        <div class=\"wrapper-third\"></div>\n\n        <div class=\"container-812\">\n            <p class=\"red-centre-bold\">Брекет-система Damon</p>\n            <p>Американские брекет-системы Damon на мировом рынке существует с 2002 года и за это время зарекомендовали себя одними из лучших ортодонтических конструкций в мире. Брекеты представлены большим количеством моделей, каждая из которых эффективна при индивидуальных особенностях нарушениях прикуса и ровности зубного ряда.</p>\n            <p><strong>Специалисты «M-Denta» устанавливают безлигатурные брекет-системы Damon Q и Damon Clear. Цена зависит от клинического случая.</strong></p>\n            <p>Damon Q представляют собой самые маленькие конструкции самолигирующей системы Damon. Они в несколько раз меньше обычных брекетов.</p>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <img src=\"/img/ort-second.png\" alt=\"ortodontiya\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Ключевая особенность - наличие дополнительных составляющих, используемых при установке специальной дуги в каждой части брекета.</p>\n                <p>Ранее ортодонтическая дуга крепилась в брекет-системах с использованием специальных лигатур. Сложность заключалась в том, что при наличии системы крепления нужно было справиться с большой силой трения, чтобы переместить зуб. В сравнении с обычными брекетами, Damon Q хорошо фиксируются на дуге, но при этом можно смещать зубы без каких-либо существенных усилий.</p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <p><strong>Преимущества Damon Q:</strong></p>\n            <p>1. Возможность лечить зубы без их удаления в ситуациях с дефицитом места в ротовой полости (как у взрослых пациентов, так и у детей).</p>\n            <p>2. Возможность улучшить эстетику улыбки.</p>\n            <p>3. Отсутствие в ограничениях по возрасту.</p>\n            <p>4. Отсутствие процессов окисления, которые свойственны брекетам других марок.</p>\n            <p>5. Лечебный эффект наступает сразу, спустя несколько недель после установки брекет-системы, а не по окончании курса лечения.</p>\n            <p>6. Необходимость смены дуг возникает гораздо реже, чем в остальных брекет-системах.</p>\n        </div>\n\n         <div class=\"container-flex-2\">\n            <img src=\"/img/ort-third.png\" alt=\"ortodontiya\">\n            <div class=\"container-flex-2-info__text\">\n                <p>Не меньшей популярностью пользуется система Damon Clear. Она прозрачная, поэтому практически незаметна на зубах. Damon Clear имеет стойкость к окрашиванию и появлению пятен.</p>\n                <p>Данный вид брекетов характеризуется закругленными контурами, создающими максимальный комфорт. Адаптационный период минимален. Благодаря основанию брекетов создается надежная фиксация и при этом происходит легкое снятие конструкции. Зачастую пациенты положительно отзываются о комфорте и эстетических результатах.</p>\n            </div>\n        </div>\n\n        <div class=\"container-812\">\n            <p>Основные преимущества Damon Clear заключаются в сочетании плюсов металлических и эстетичности сапфировых брекет-систем.</p>\n            <p>К ним относятся доступная ценовая политика, компактные размеры, и качество самолигирования, благодаря которым происходит свободное движение дуги в пазу брекета.</p>\n        </div>\n\n        <div class=\"wrapper-fourth\"></div>\n		-->\n        \n        <div class=\"container-812\">\n            <h2 class=\"red-centre-bold\">Брекет-система H4</h2>\n            <p>Американская брекет-система H4 – разработка корпорациии Ortho Classic, занимающейся производством дентальных конструкций с 1980-х гг., и автора самолигирующих брекетов доктора Томаса Питтса.</p>\n        </div>\n\n        <div class=\"container-flex-2\">\n            <!-- <img src=\"/img/ort-fourth.png\" alt=\"ortodontiya\"> -->\n            <div class=\"video\">\n            	  <video width=\"480\" height=\"480\" controls=\"false\" autoplay muted loop>\n                   	<source src=\"video/video.mp4\" type=\'video/mp4; codecs=\"avc1.42E01E, mp4a.40.2\"\'>\n                  </video>\n            </div>\n            <div class=\"container-flex-2-info__text\">\n            	<p>Американская брекет-система H4 – разработка корпорациии Ortho Classic, занимающейся производством дентальных конструкций с 1980-х гг., и автора самолигирующих брекетов доктора Томаса Питтса.</p>\n                <p>Брекеты H4 – брекеты нового поколения. Их внутренняя поверхность, рисунок протектора разработана в соответствии с анатомическими особенностями строения зуба, что позволяет закрепить их плотно и избежать возможного открепления в процессе лечения.</p>\n                <p>H4 – самолигирующие, то есть безлигатурные брекеты. Это значит, что дуга в них крепится не с помощью резинок или металлических фиксаторов, а с помощью замочка, расположенного на самом брекете. Американская инновационная разработка позволила создать такой механизм крепления, который не требует дополнительных инструментов для фиксации дуги. Как результат – дуга перемещается свободно, минимизируя давление на челюсть.</p>\n                <p>Американская инновационная разработка позволила создать такой механизм крепления, который не требует дополнительных инструментов для фиксации дуги. Как результат – дуга перемещается свободно, минимизируя давление на    </p>\n            </div>\n        </div>\n\n        <div class=\"wrapper-fifth\">\n            <div class=\"container-812\">\n                <p>Преимущества брекет-системы H4:</p>\n                <ul>\n                    <li>Закруглённые края брекет-замочков не травмируют язык и щёки изнутри;</li>\n                    <li>Дуга крепится непосредственно к брекету, перемещается в нём свободно, обеспечивая естественное перемещение зуба, что позволяет избежать непредсказуемых результатов;</li>\n                    <li>Позволяет сохранить здоровые зубы, делая улыбку поистине голливудской: не на 6, а на 12 видимых передних зубов;</li>\n                    <li>На 4 месяца сокращается срок исправления прикуса;</li>\n                    <li>Из-за естественного заданного хода зубов сокращается количество визитов к стоматологу в процессе лечения;</li>\n                    <li>Благодаря низкому давлению на зубы подходят для выравнивания зубов всей семьи – взрослых, детей и пожилых;</li>\n                    <li>Обеспечивают лёгкую ежедневную гигиену и уход, так как углы брекетов максимально гладкие и нет дополнительных фиксаторов – резинок, металлических проволочек.</li>\n                    <li>Видимый результат появляется через 3-4 месяца.</li>\n                </ul>\n            </div>\n        </div>\n        \n		<div class=\"container-flex-2\">\n            <img src=\"/img/new/ispr-1.jpg\" alt=\"ortodontiya\">\n            <div class=\"container-flex-2-info__text\">\n                <p>На первичной консультации стоматолог-ортодонт оценивает состояние зубов, степень нарушения прикуса, наличие или отсутствие воспалительных процессов в ротовой области. Если есть кариес или другие заболевания, сначала лечат их, только после этого устанавливают брекеты.</p>\n            </div>\n        </div>\n        \n        <div class=\"container-812\">\n\n        </div>\n    \n        <div class=\"container-flex-pl13\">\n            <img src=\"/img/impl-red-instrument.png\" alt=\"ortodontiya\">\n            <div class=\"container-flex-pl13-info__text\">\n                <p>Затем делают рентгеновский снимок, гипсовый слепок зубных рядов, артикуляционное исследование.</p>\n            </div>\n        </div>\n        <div class=\"container-flex-pl13\">\n            <img src=\"/img/impl-red-water.png\" alt=\"ortodontiya\">\n            <div class=\"container-flex-pl13-info__text\">\n                <p>Стоматолог-ортодонт проводит гигиеническую чистку и санацию ротовой полости, чтобы плотнее зафиксировать брекеты на эмали;</p>\n            </div>\n        </div>\n        <div class=\"container-flex-pl13\">\n            <img src=\"/img/lech-scary-red.png\" alt=\"ortodontiya\">\n            <div class=\"container-flex-pl13-info__text\">\n                <p>С помощью специального клея элементы дентальной ортодонтической конструкции крепятся к зубам, в конце через них продевается дуга.</p>\n            </div>\n        </div>\n        <div class=\"container-flex-pl13\">\n            <img src=\"/img/red-sandclock.png\" alt=\"ortodontiya\">\n            <div class=\"container-flex-pl13-info__text\">\n                <p>Процесс фиксации длится 1,5-2 часа, а лечение брекетами 1,5-2 года.</p>\n            </div>\n        </div>\n\n		<div class=\"container-flex-2\">\n            <img src=\"/img/new/ispr-2.jpg\" alt=\"ortodontiya\">\n            <div class=\"container-flex-2-info__text\">\n                            <p>После снятия брекетов для закрепления результатов стоматолог-ортодонт предложит съёмные или несъёмные ретейнеры, чтобы зубы снова не вернулись в исходное положение. Срок их носки зависит от того, насколько сильно изначально был нарушен прикус.</p>\n            </div>\n        </div>\n        \n        <div class=\"container-812\">\n            <p><strong>Брекеты H4, которые устанавливают стоматологи-ортодонты в авторской клинике «M-Denta», безболезненный и быстрый способ создать здоровую и естественную улыбку.</strong></p>\n        </div>\n\n    </section>'),
(98, 173, 'ru', '<section class=\"zubotehnicheskaya-laboratoriya\">\n        \n        <div class=\"container-812\">\n            <h2 class=\"black-centre-24\">Зуботехническая лаборатория в Краснодаре</h2>\n        </div>\n		\n        <div class=\"container-812\">\n            <p>Зуботехническая лаборатория – структурное подразделение авторской стоматологической клиники M-Denta, в которой зубные техники изготавливают дентальные ортопедические конструкции: создают протезы любой сложности, вручную подбирают цвет металлокерамики и раскрашивают готовое изделие. </p>\n        </div>\n        \n        <div class=\"container-flex-2\">\n        	<img src=\"/img/tooth-lab.png\" alt=\"zubotehnicheskaya-laboratoriya\">	\n            <div class=\"container-flex-2-info__text\">\n                <p><strong>Особенности зуботехнической лаборатории</strong></p>\n                <ul>\n                	<li>Зуботехническая лаборатория, расположенная на территории стоматологической клиники M-Denta, оснащена самым современным и высокотехнологичным оборудованием в области зубного протезирования. </li>\n                	<li>Тесное сотрудничество стоматолога-ортопеда и зубного техника позволяет изготавливать максимально функциональные протезы с учётом индивидуальных особенностей строения челюсти каждого пациента. Все это происходит в максимально короткие сроки, при каждой примерке конструкции присутствует зубной техник, что позволяет учесть все нюанса для успешного результата. </li>\n                </ul>\n            </div>\n            \n        </div>\n\n        <div class=\"container-812\">\n            <ul>\n                <li> Одного только современного оборудования мало, чтобы изготовить идеальную стоматологическую конструкцию. Только человек с 20-летним опытом и международным образованием, коем является наш заведующий зуботехнической лабораторией, придаст коронке такой вид, что никто и никогда не отличит искусственный зуб от естественного. </li>\n                <li>И зубной техник, и стоматолог-ортопед регулярно присутствуют на российских и международных медицинских конференциях и симпозиумах, повышают свою квалификацию, внедряют новые техники лечения и протезирования зубов. </li>\n            </ul>\n        </div>\n\n    </section>'),
(100, 174, 'ru', '<section class=\"estetic-main\">\n        \n      <div class=\"container-812\">\n          <p>В нашей стоматологической клинике вы можете пройти различные процедуры в области эстетической стоматологии. Мы выполняем гигиеническую чистку зубного камня и снятие налета, осуществляем отбеливание зубов при помощи новейших технологий, в числе которых Zoom 4 отбеливание.</p>\n          <p>У нас можно пройти установку виниров, получивших широкое распространение в эстетической стоматологии. Внешне они представляют собой тонкие, но одновременно очень прочные керамические накладки, благодаря которым, пациент может легко добиться результата голливудской улыбки.</p>\n          <p>Как только у нас появляется желание получить голливудскую улыбку, возникает вопрос - а не навредит ли это?</p>\n      </div>\n\n      <div class=\"container-flex-2\">\n          <img src=\"img/estetic-first.png\" alt=\"estetic\">\n          <div class=\"container-flex-2-info__text\">\n              <p>Различные способы отбеливания зубов были изобретены еще в древности. Красивые зубы считались хорошим тоном, тогда в отбеливание использовали азотную и соляную кислоту, а также отшлифовывание слоя эмали напильником…\nК счастью, сегодня появились более гуманные способы отбеливания в домашних условиях. Одним из таких является гелиевый процесс с каппами, но и здесь есть подводные камни. Сложно спрогнозировать результат, если нет профессионального опыта. Если переборщить с концентрацией или временем, результат может даже навредить - усилить чувствительность зубов.</p>\n              <p>Да и вообще, значительно изменить цвет зубов в домашних условиях достаточно сложно. Если Вам все-таки кажется, что отбеливание необходимо, стоит выбрать профессиональный подход.</p>\n          </div>\n      </div>\n\n      <div class=\"container-812\">\n          <p>Профессионал никогда не пойдёт на отбеливание зубов, если сомневается в отсутствии противопоказаний. Консультация специалиста избавит Вас от множества вопросов, а доктор всегда поможет выбрать оптимальный метод отбеливания и подготовит Вас к данной процедуре.</p>\n          <p>На сегодняшний день существует масса видов бережного и надежного отбеливания в клиниках. Многие считают отбеливание небезопасным и разрушающим, но специалисты уверяют, что в руках настоящих профессионалов Вы не только сможете получить превосходную улыбку, но и улучшить состояние своих зубов, сделав их здоровым, сильными и красивыми. Ведь отбеливание удаляет приобретённые в результате приёма пищи пигменты, а не вымывает природные.</p>\n      </div>\n\n      <div class=\"container-flex-2\">\n          <img src=\"img/estetic-second.png\" alt=\"estetic\">\n          <div class=\"container-flex-2-info__text\">\n              <p>Дело в том, что стоматологи прошлого века, сталкивались с нелегальными средствами отбеливания зубов, в основе которых были кислотные растворы, приводившие к серьёзным поражениям эмали.</p>\n              <p>Помимо того, большой ущерб современной стоматологи наносят невежды, заполонившие современные блоги, журналы и соц. сети, которым бы не помешало изучить современные возможности клиник.</p>\n              <p>А вот многие, например, даже и не знают, что повышенная чувствительность зубов, которая возникает в процессе проведения некоторых методик отбеливания зубов, совсем не свидетельствует о разрушении эмали, а только лишь о встраивании свободных кислородов в структуру зуба.</p>\n          </div>\n      </div>\n    \n      <div class=\"container-812\">\n          <p>Отбеливание, несомненно, воздействует на зубы, но не больше, чем окружающая нас среда, пища и природные условия.</p>\n          <p><strong>Авторская стоматологическая клиника «M-Denta» предлагает надежное и бережное лазерное отбеливание по последним современным технологиям.</strong></p>\n          <p>Только у нас Вы получите прекрасную и белоснежную улыбку без вреда для здоровья!</p>\n      </div>\n      \n    </section>'),
(101, 175, 'ru', '<section class=\"estetic-chistka\">\n        \n      <div class=\"container-812\">\n          <a href=\"/esteticheskaya-stomatologiya\" class=\"nav-link\"> << Эстетическая стоматология</a>\n          <h1 class=\"black-centre-24\">Гигиеническая чистка зубов в Краснодаре</h1>\n      </div>\n\n      <div class=\"container-flex-2\">\n        <img src=\"/img/chistka-first.png\" alt=\"estetic-chistka\">\n          <div class=\"container-flex-2-info__text\">\n              <p>Удаление налета и снятие зубного камня не могут выполнить даже самые эффективные зубные пасты и зубные нити. </p>\n              <p>Решить проблему можно легко, обратившись в стоматологическую клинику «M-Denta», где успешно применяется процедура гигиенической чистки зубов. Врачи рекомендуют проходить чистку зубов два раза в год. Это позволит своевременно избавиться от зубного налета и предотвратить образование зубного камня.</p>\n              <p><strong>Выделяют несколько методик, при помощи которых можно эффективно избавиться от зубного налета, а также твердых и мягких зубных отложений. Наиболее популярной и часто применяемой врачами является использование ультразвукового аппарата.</strong></p>\n          </div>\n      </div>\n\n      <div class=\"container-812\">\n          <p>Распространенной и эффективной считается комплексная процедура, которая включает в себя сочетание ультразвука и Air Flow — инновационная методика, с помощью которой можно удалить мельчайшие частицы из труднодоступных участков ротовой полости. При проведении процедуры с использованием ультразвукового прибора снимаются массивные отложения, а также налет. По окончании применяется специальная абразивная паста с помощью которой происходит обработка поверхности зубов.</p>\n      </div>\n      \n    </section>');
INSERT INTO `db__str_filling` (`id`, `pid`, `locale`, `content`) VALUES
(103, 176, 'ru', '<section class=\"estetic-chistka\">\n        \n      <div class=\"container-812\">\n          <a href=\"/esteticheskaya-stomatologiya\" class=\"nav-link\"> << Эстетическая стоматология</a>\n          <h1 class=\"black-centre-24\">Отбеливание зубов Zoom 4</h1>\n      </div>\n\n      <div class=\"container-flex-2\">\n        <img src=\"/img/zoom-first.png\" alt=\"estetic-chistka\">\n          <div class=\"container-flex-2-info__text\">\n              <p>В стоматологической клинике «M-Denta» вы также можете пройти отбеливание по методике Zoom 4. Данная технология отличается от других своей безопасностью. </p>\n              <p>В средстве, наносимом на поверхность эмали, содержится гораздо меньше перекиси водорода, что дает возможность сохранить структуру и толщину зубной эмали. Столь поражающий эффект не может стоить очень дешево, поэтому цена Zoom-отбеливания зубов зависит от конкретной клинической ситуации.</p>\n              <p>Методика Zoom 4 прошла четыре стадии и читается самой популярной и максимально усовершенствованной. Основные преимущества стоматологического отбеливания зубов по данной технологии — это комфорт и безопасность процесса. </p>\n          </div>\n      </div>\n\n      <div class=\"container-812\">\n          <p>В стоматологической клинике «M-Denta» принцип проведения процедуры отточен до совершенства, а процесс ее выполнения полностью безопасен. При разработке методики особое внимание уделялось усовершенствованному составу геля, который применяется при отбеливании, а количество перекиси водорода, входящей в его состав, уменьшилось на 10%.</p>\n      </div>\n      \n    </section>'),
(104, 177, 'ru', '<section class=\"contacts\">\n    \n      <div class=\"container-812\">\n          <h1 class=\"black-centre-24\">Контакты</h1>\n      </div>\n\n      <div itemscope itemtype=\"http://schema.org/Organization\">\n      <span itemprop=\"name\" class=\"hidden\">М-Дента</span>\n          <div itemprop=\"address\" itemscope itemtype=\"http://schema.org/PostalAddress\" class=\"address contacts-flex\">\n              <p class=\"contacts-flex-item\"> Подписывайтесь на наш Инстаграм <a class=\"link\" href=\"https://www.instagram.com/stomatolog_evgeney/ \">stomatolog_evgeney </a></p>\n              <p class=\"contacts-flex-item\">г. <span itemprop=\"addressLocality\">Краснодар</span>, <span itemprop=\"streetAddress\" class=\"street\">ул. Северная, 490</span> БЦ \"Кутузовский\",<br> офис 603 (6 этаж)</p>\n              <p class=\"contacts-flex-item\"><strong>тел/факс: <span itemprop=\"telephone\">+7 (861) 298-08-51</span><br> моб.: <span itemprop=\"telephone\">+7 (918) 440-33-48</span></strong><br> e-mail: <span itemprop=\"email\">m-denta-88@mail.ru</span></p>\n              <p class=\"contacts-flex-item\"><strong>Режим работы:</strong><br> пн-пт: 09:00 - 20:00<br> сб: 09:00 - 17:00 <br>вс: выходной</p>\n          </div>\n      </div>\n\n      <div class=\"contacts-map\">\n      	<iframe src=\"https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d3987.3103509051634!2d38.99755404973732!3d45.03600438092689!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1z0Lwt0LTQtdC90YLQsA!5e0!3m2!1sru!2sru!4v1540471756071\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>\n      </div>'),
(109, 178, 'ru', ' <h1>О Клинике</h1>\n<p>Клинику M-Denta основала потомственная семья медиков Мыльцевых в 1997 году. \nОснователи клиники постоянно совершенствуют методы стоматологической реабилитации пациентов. Они имеют за плечами не только российское высшее медицинское образование, но и длительную стажировку в известных стоматологических клиниках Европы и США.</p>\n<p>Весь коллектив стоматологии M-Denta регулярно участвует в симпозиумах и научных конференциях как в России, так и за рубежом.</p>\n<div class=\"page-content__img\">\n	<img src=\"/img_new/about1.png\"/>\n    <img src=\"/img_new/about2.png\"/>\n    <img src=\"/img_new/about3.png\"/>\n</div>\n<h2>Собственная зуботехническая лаборатория</h2>\n<p>Зуботехническая лаборатория – структурное подразделение авторской стоматологической клиники M-Denta, в которой зубные техники изготавливают дентальные ортопедические конструкции: создают протезы любой сложности, вручную подбирают цвет металлокерамики и раскрашивают готовое изделие.</p>\n<div class=\"page-content__img\">\n	<img src=\"/img_new/about4.png\"/>\n    <img src=\"/img_new/about5.png\"/>\n    <img src=\"/img_new/about6.png\"/>\n</div>\n<h2>Главный врач клиники M-Denta - Мыльцев Евгений</h2>\n<p>Зуботехническая лаборатория – структурное подразделение авторской стоматологической клиники M-Denta, в которой зубные техники изготавливают дентальные ортопедические конструкции: создают протезы любой сложности, вручную подбирают цвет металлокерамики и раскрашивают готовое изделие.</p>\n<div class=\"page-content__img\">\n	<img src=\"/img_new/about7.png\"/>\n    <img src=\"/img_new/about8.png\"/>\n</div>\n'),
(117, 206, 'ru', '<h2 class=\"h1_size\">Что такое дентальный имплантат Nobel Biocare</h2>\n      \n<p>Дентальный имплантат - это искусственный титановый корень – стержень с резьбой, который вживляется в челюсть взамен утраченных собственных зубов. </p>\n<p>Шведская компания Nobel Biocare – первая компания, которая 43 года назад начала практиковать массовое производство и внедрение дентальных имплантов.</p>\n<p>Всё началось с того, что в 1952 г. шведский хирург Пер-Ингвар Бранемарк открыл явление остеоинтеграции – способность титана срастаться с костью. </p>  \n        \n<p>Как и тогда, сегодня импланты Nobel Biocare изготовлены из медицинского титана. Многочисленные исследования подтвердили, что этот материал не вступает в химические реакции со слабощелочной средой ротовой полости, не вызывает воспаление слизистых, не подвержен коррозии, феноменально прочен и не создаёт повышенной нагрузки на челюстную кость. </p>\n<p>Титановые импланты Nobel Biocare на 100% биологически совместимы и имеют подтверждённое независимой экспертизой и строжайшими тестами качество. Каждому пациенту после установки выдают сертификат соответствия, где указан уникальный серийный номер изделия. По нему стоматолог в любой клинике, сотрудничающей с Nobel Biocare, может узнать дату и время выпуска. Кроме того, на импланты предусмотрена пожизненная гарантия.</p>\n<p>В 99,7% случаях дентальный имплант полностью приживается в челюстной кости, возвращая пациентам радость жизни. </p>\n        \n        \n        <div class=\"wrapper\"></div>\n\n<h3 class=\"h1_size\">Что такое дентальный имплантат MIS</h3>    \n        <div class=\"container-flex-2\">\n             <img src=\"/img/new/impl-2.jpg\" alt=\"Дентальный имплантат MIS\" title=\"Дентальный имплантат MIS\">\n             <div class=\"container-flex-2-info__text\">\n             <p>Израильская компания MIS Implant Technologies Ltd. основана в 1995 г. Сегодня она входит в пятёрку самых популярных имплантологических брендов в мире. Импланты производятся на самых точных щвейцарских станках со степенью погрешности +- 0,005 мм. Японские лазерные измерительные приборы обеспечивают 100% контроля качества изделий на каждом этапе. </p>\n            <p>Дентальные ортопедические конструкции MIS также изготовлены из хирургического титана. Их поверхность обрабатывают пескоструем и кислотным травлением, что увеличивает остеоинтеграцию и первичную стабильность. </p>\n            <p>При должном уходе срок службы импланта неограничен. Изделие сопровождается пожизненной гарантией и сертификатом соответствия.  </p>\n                 \n             </div>\n         </div>\n<p>Разница между Nobel Biocare и MIS заключается в цене: Nobel Biocare выше по стоимости, израильские аналоги (MIS) – более доступны.  </p>\n                 <p>Установка дентальных имплантов имеет очевидные преимущества перед съёмными зубными протезами.</p>\n                <ul>\n                    <li>Долговечность, проверенная временем</li>\n                    <li>Естественность улыбки.</li>\n                    <li>Возможность сохранить соседние зубы здоровыми и ненагруженными.</li>\n                    <li>Устойчивость и комфортное ношение.</li>\n                    <li>Естественность улыбки.</li>\n                </ul>\n         <div class=\"wrapper-second\">\n             <h3 class=\"h1_size\">Что включает в себя имплантация зубов</h3>\n             \n                 <p>Дентальная имплантация - метод протезирования зубов, при котором в челюстную кость устанавливают имплантат. На него либо одномоментно, либо после приживления имплантатов фиксируют коронки. </p>\n                 <p>Методы имплантации зубов различают по времени установки имплантата со момента удаления зуба. В зависимости от этого выделяют: </p>\n                 <ul>\n                     <li>Классическую имплантацию</li>\n                     <li>Одномоментную, или одноэтапную имплантация зубов</li>\n                 </ul>\n                 <p>Этапы и процедуры для разных методов имплантации зубов отличаются. Рассмотрим каждый метод в отдельности подробнее.</p>\n              \n         </div>\n        \n        \n            <h2 class=\"h1_size\">Классическая (традиционная) имплантация зубов</h2>\n            <p>При использовании этого метода врачи-стоматологи уделяют особое внимание состоянию костной ткани челюсти пациента, так как классическая имплантация зубов предъявляет самые высокие требования к состоянию костной ткани. При недостатке кости для крепления имплантата проводится ее предварительное наращивание.Следует так же отметить, что по времени - это самый длительный метод имплантации.</p>\n            <h3 class=\"h2_size\">Этапы классической имплантации</h3>\n            <h4 class=\"h3_size\"><strong>1. Подготовка к имплантации.</strong></h4>\n            <p>На этом этапе пациент проходит полное обследование у стоматолога. Проводятся диагностические процедуры, делается нужное количество снимков. Только после получения полной информации о состоянии костной ткани и полости рта пациента врач-стоматолог составляет план лечения.</p>\n       \n\n        <div class=\"container-flex-2\">\n             <img src=\"/img/new/impl-3.jpg\" alt=\"Классическая имплантация зубов\" title=\"Классическая имплантация зубов\">\n             <div class=\"container-flex-2-info__text\">\n                 <h4 class=\"h3_size\" style=\"margin-top: 0;\"><strong>2. Удаление проблемных зубов и лечение проблемных участков полости рта.</strong></h4> \n                 <p>Так как дентальная имплантация оказывает значительную нагрузку на полость рта и весь организм, то перед ней врач предварительно должен устранить все существующие стоматологические проблемы пациента. При обнаружении воспалительных процессов установку имплантатов откладывают до полного выздоровления. </p>\n                 <p>Далее удаляется проблемный зуб или несколько зубов. После этого пациенту назначаются препараты и даются рекомендации для более комфортного прохождения следующего этапа - послеоперационной реабилитации.</p>\n             </div>\n         </div>\n\n         \n            <h4 class=\"h3_size\"><strong>3. Заживление десны и восстановление костной ткани на месте удаленного зуба (зубов).</strong></h4>\n            <p>На этот этап требуется от 2-х до 4-х месяцев. Только убедившись, что десна полностью зажила и костная ткань восстановилась, стоматолог может приступать к следующему этапу. Иногда может потребоваться дополнительное время на заживление.</p>\n            <h4 class=\"h3_size\"><strong>4. Хирургический этап имплантации зубов.</strong></h4>\n            <p>На этом этапе врач-стоматолог делает разрез десны и специальным инструментом препарирует ложе под имплантат. Затем имплантат вживляют в челюстную кость.</p>\n            <p>Далее клиническая ситуация развивается двумя возможными вариантами:</p>\n            <ul>\n                <li>На имплант сверху устанавливается заглушка – тоненький вшиток. После её фиксации всё зашивают. Через 2-6 месяцев на это место устанавливается формирователь десны.</li>\n                <li>В другом случае формирователь десны ставится сразу же после вживления импланта. Он служит для формирования мягких тканей вокруг имплантата.</li>\n            </ul>\n            <p>Выбор того или иного варианта зависит от того, с какой силой (торком) встал имплантат в челюстную кость. </p>\n            <h4 class=\"h3_size\"><strong>5. Установка постоянных протезов.</strong></h4>\n            <p>Постоянное протезирование обычно проводится после 2-6 месяцев после хирургического этапа имплантации зубов. За это время зубной имплант полностью сращивается с костной тканью, и происходит полное заживление десны. Временные протезы убираются, готовится финальный оттиск для постоянных протезов, и когда они будут готовы, врач-стоматолог фиксирует их на зубной имплантат. Постоянные протезы могут быть изготовлены из различных материалов.</p>\n            <p>Установленные зубные имплантаты устойчивы к сильным нагрузкам, и практически ни в чем не уступают здоровым зубам человека.</p>\n            <p>При классической имплантации зубов можно закрепить любые дентальные ортопедические конструкции: одиночный протез, мостовидный протез и даже полный условно-съемный протез.</p>\n        \n\n        <div class=\"wrapper-third\"></div>\n        \n        <h2 class=\"h1_size\">Одномоментная (одноэтапная) имплантация зубов</h2>\n\n        \n            <p>Основной приоритет авторской клиники «М-Дента» - зубы с функциональной нагрузкой сегодня и сейчас. Это достигается благодаря одномоментной имплантации зубов – метода, в котором дентальная имплантация происходит с немедленной нагрузкой. Она позволяет за два посещения стоматолога восстановить функциональность челюсти и вернуть здоровую улыбку. </p>\n       \n\n        <h3 class=\"h2_size\">Этапы одномоментной (немедленной) имплантации:</h3>\n\n       \n            <ul>\n                <li>Разрушенный зуб удаляют и в тот же день устанавливают имплантат. Если клиническая ситуация позволяет, на имплант сразу фиксируется временная коронка. Как правило, после этого пациенты сразу могут жевать и улыбаться. В это время в собственной зуботехнической лаборатории изготавливают постоянную коронку.</li>\n                <li>Через 3 месяца после предыдущего этапа стоматолог без операции фиксирует постоянную коронку. Пациент может вернуться к привычному образу жизни.</li>\n            </ul>\n       \n\n        <h2 class=\"h1_size\">Имплантация Nobel Biocare при частичном отсутствии зубов</h2>\n		<p>Имплантаты Nobel Biocare решают функциональные проблемы ротовой полости, если не хватает одного или нескольких зубов.</p>\n        <h3 style=\"margin-top: 0;\" class=\"h2_size\"><strong>При отсутствии одного зуба</strong></h3>\n        <div class=\"container-flex-2\">\n             <img src=\"/img/new/impl-4.jpg\" alt=\"Имплантация Nobel Biocare при частичном отсутствии зубов\" title=\"Имплантация Nobel Biocare при частичном отсутствии зубов\">\n             <div class=\"container-flex-2-info__text\">\n                 \n                 \n                 <p>Отсутствующий зуб заменяют коронкой, которую фиксируют на имплант. Имплантат при этом играет роль корня зуба, опоры для коронки. Материал поверхности имплантата сохраняет имеющий уровень костной ткани, препятствуя её атрофии. </p>\n                 <p>Такой способ позволяет сохранить соседние зубы здоровыми, потому что искусственный зуб соединяется непосредственно с имплантом.</p>\n             </div>\n         </div>\n		<h3 style=\"margin-top: 0;\" class=\"h2_size\"><strong>При отсутствии нескольких зубов </strong></h3>\n         <div class=\"container-flex-2\">\n             <img src=\"/img/new/impl-5.jpg\" alt=\"Имплантация зубов Nobel Biocare в Краснодаре\" title=\"Имплантация зубов Nobel Biocare в Краснодаре\">\n             <div class=\"container-flex-2-info__text\">\n                \n                <p>Если в ряду не хватает больше одного зуба, разумным решением будет поставить мост на имплантах. Мост – ортопедическая дентальная конструкция из искусственных зубов, которые выглядят как настоящие. Его фиксируют на несколько имплантов. </p>\n                <p>Мост препятствует движению соседних зубов, то есть сохраняет прикус неизменным. Из-за крепления непосредственно к имплантатам соседние зубы не подвергаются давлению. Мостовидная дентальная конструкция полностью восстанавливает жевательную функцию, а правильные движения челюсти при жевании и материал поверхности импланта сохраняют имеющийся уровень костной ткани, препятствую её истончению.</p>\n             </div>\n         </div>      \n        \n        <h3 class=\"h1_size\">Как планируется установка импланта</h3>\n        \n        <ul>\n            <li><p>Сначала стоматолог определяет, подходит ли пациенту дентальная имплантация. В области десны и кости челюсти не должно быть патологий и воспалений.</p></li>\n      \n\n        \n            <li><p>Диагностические исследования при помощи рентгена определяют тип и количество кости. Если зубы отсутствуют давно, костной ткани будет мало.</p></li>\n       \n            <li><p>Для составления плана лечения используют компьютерные технологии - 3D-изображения тканей полости рта. Полученные данные о точной высоте, ширине и объёме кости помогают врачу определиться с оптимальным положением имплантата. </p></li>\n      \n\n       \n            <li><p>В соответствии с планом лечения может быть изготовлен хирургический шаблон. Он используется для безопасного и точного сверления. Иногда его применяют на всех этапах операции и для установки имплантата. </p></li>\n      </ul>\n        \n            <p>Как и к любой хирургической операции, для имплантации зубов существуют противопоказания. Их можно разделить на абсолютные, относительные и временные противопоказания.</p>\n       \n\n        <div class=\"wrapper-fourth\">\n            \n                <h3 class=\"h2_size\">Абсолютные противопоказания при имплантации зубов</h3>\n                <p>Наличие этих противопоказаний означает что пациенту запрещено проводить имплантацию зубов.</p>\n                <ul>\n                    <li>Заболевания крови, кроветворных органов</li>\n                    <li>Заболевания центральной нервной системы</li>\n                    <li>Злокачественные новообразования различных органов и систем</li>\n                    <li>Иммунопатологические состояния</li>\n                    <li>Системные заболевания соединительной ткани</li>\n                    <li>Туберкулез</li>\n                    <li>Некоторые заболевания слизистой оболочки полости рта</li>\n                    <li>Хронический рецидивирующий стоматит, красная волчанка, пузырчатка, синдром Шегрена</li>\n                    <li>Сахарный диабет 1 типа</li>\n                    <li>Гипертонус жевательных мышц, бруксизм</li>\n                </ul>\n            </div>\n        \n        \n        \n            <h3 class=\"h2_size\">Относительные противопоказания</h3>\n            <p>Наличие у пациента этих противопоказаний означает, что имплантация зубов возможна. Однако могут потребоваться дополнительные процедуры в процессе имплантации.</p>\n        \n\n        \n                <ul>\n                    <li>Отсутствие санации полости рта</li>\n                    <li>Неудовлетворительная гигиена полости рта</li>\n                    <li>Гингивит, маргинальный периодонтит</li>\n                    <li>Заболевания височно-нижнечелюстного сустава</li>\n                    <li>Временная атрофия или дефект костной ткани альвеолярного отростка</li>\n                    <li>Курение, алкоголизм, наркомания</li>\n                    <li>Патологические прикусы</li>\n                </ul>\n       \n\n        \n            <h3 class=\"h2_size\">Временные противопоказания</h3>\n            <p>Эти противопоказания устранимы. И после их устранения, процедуру имплантации зубов можно проводить.</p>\n            <ul>\n                <li>Острые заболевания</li>\n                <li>Стадии реабилитации и выздоровления</li>\n                <li>Беременность</li>\n                <li>Наркотическая зависимость</li>\n                <li>Состояния после облучения</li>\n            </ul>\n        \n\n        <div class=\"wrapper-fifth\"></div>\n        \n        \n            <h2 class=\"h1_size\">Особенности ухода за зубными имплантатами</h2>\n            <p>После того, как будут установлены имплантаты, ухаживать за ротовой полостью придётся тщательно. Гигиена включает в себя:</p>\n\n            <div class=\"flex-container impl-uhod\">\n                <div class=\"w30\">\n                   <img src=\"/img_new/ico1.png\" alt=\"brush\"> \n                   <p>чистку зубов два раза в день специальной пастой и щёткой</p>\n                </div>\n                <div class=\"w30\">\n                   <img src=\"/img_new/ico2.png\" alt=\"shetka\"> \n                   <p>применение зубной нити и ёршика</p>\n                </div>\n                <div class=\"w30\">\n                   <img src=\"/img_new/ico3.png\" alt=\"drop\"> \n                   <p>ополаскивание полости рта</p>\n                </div>\n                <div class=\"w30\">\n                   <img src=\"/img_new/ico4.png\" alt=\"water\"> \n                   <p>обработку полости рта ирригатором</p>\n                </div>\n                <div class=\"w30\">\n                   <img src=\"/img_new/ico5.png\" alt=\"calendar\"> \n                   <p>посещение стоматолога через месяц после установки имплантата</p>\n                </div>\n                <div class=\"w30\">\n                   <img src=\"/img_new/ico6.png\" alt=\"doctor\"> \n                   <p>консультации у стоматолога каждые полгода</p>\n                </div>\n            </div>\n\n            <p><strong>Приоритет клиники «M-Denta» - здоровые зубы с функциональной нагрузкой здесь и сейчас, при этом сложность клинической ситуации значения не имеет.</strong></p>\n            <p>Собственная современная зуботехническая лаборатория позволяет нам моделировать и создавать сверхточное функциональное ортопедическое изделие в самые короткие сроки.</p>');
