INSERT INTO `db__str_structure` (`id`, `pid`, `tid`, `gid`, `locale`, `title`, `keywords`, `description`, `robots`, `url`, `name`, `menuname`, `sys_name`, `redirect`, `uid`, `mod_id`, `access`, `dynamic`, `in_sitemap`, `in_menu`, `date`, `visible`, `ord`, `created`, `updated`) VALUES
(1, 0, 5, 0, 'ru', 'Стоматологическая клиника в Краснодаре | Стоматология M-Denta', '', 'Стоматологическая клиника в Краснодаре M-Denta предоставляет широкий спектр стоматологических услуг. Доступные цены и отменное качество успешно выделяют нас среди всех стоматологических клиник Краснодара.', 'index,follow', '/', 'Главная', 'Главная', 'main', '', 1, 0, '0', 0, 1, '', 0, 1, 15, 2147483647, NULL),
(100, 1, 1, 0, 'ru', 'Стоматология в Краснодаре | M-Denta', '', 'Стоматология в Краснодаре M-Denta предлагает одни из самых доступных цен среди стоматологических клиник Краснодара. Мы гарантируем высокое качество материалов и услуг. Гордимся безупречным сервисом.', 'index,follow', '/about', 'О клинике', 'О клинике', 'about', '', 0, 0, '', 0, 1, '7', 1540278180, 1, 10, NULL, NULL),
(101, 1, 1, 0, 'ru', 'Стоматология в Краснодаре. Цены и стоимость услуг в клинике M-Denta', '', 'В этом разделе Вы всегда сможете просмотреть актуальные цены и стоимость, на стоматологические услуги, предоставляемые клиникой М-Дента. Мы заботимся о наших клиентах.', 'index,follow', '/ceny', 'Цены', 'Цены', 'ceny', '', 0, 0, '', 0, 1, '7', 1540278360, 0, 40, NULL, NULL),
(102, 1, 1, 0, 'ru', 'Контакты стоматологической клиники M-Denta', '', 'Стоматологическая клиника M-Denta находится в БЦ Кутузовский, и расположена в центре города. Наш адрес: г. Краснодар, ул. Северная, 490. Тел. +7(861)298-08-51.', 'index,follow', '/kontakty', 'Контакты', 'Контакты', 'kontakty', '', 0, 0, '', 0, 1, '7', 1540278360, 0, 45, NULL, NULL),
(103, 1, 1, 0, 'ru', 'Лечение зубов в Краснодаре в стоматологии M-Denta', '', 'Лечение зубов в Краснодаре любой сложности по доступным ценам в стоматологической клинике M-Denta.', 'index,follow', '/lechenie-zubov', 'Лечение зубов', 'Лечение зубов', 'lechenie-zubov', '', 0, 0, '', 0, 1, '8', 1540283820, 1, 50, NULL, NULL),
(104, 1, 1, 0, 'ru', 'Имплантация зубов в Краснодаре, установка зубных имплантатов Nobel', '', 'Все виды имплантации зубов в Краснодаре по доступным ценам - в стоматологической клинике M-Denta. Установка зубных имплантатов Nobel с гарантией.', 'index,follow', '/implantaciya-zubov', 'Имплантация зубов', 'Имплантация зубов', 'implantaciya-zubov', '', 0, 0, '', 0, 1, '8', 1540283880, 1, 65, NULL, NULL),
